INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (18, 'Museo de Historia Natural da Universidade de Santiago', 15705, '<p>As <a href="http://www.santiagoturismo.com/arquitecturas-de-autor/museo-de-historia-natural-luis-iglesias" target="_blank">instalaci&oacute;ns</a> do Museo de Historial Natural no <a href="http://www.santiagoturismo.com/parques-e-xardins/parque-de-vista-alegre-finca-simeon" target="_blank">parque de Vista Alegre</a> po&ntilde;en ao alcance do p&uacute;blico xeral un conxunto patrimonial que se remonta ao s&eacute;culo XIX con pezas singulares de gran valor para o estudo e a divulgaci&oacute;n da biodiversidade e o medio ambiente.<br /><br />Os principais espazos das novas instalaci&oacute;ns agr&uacute;panse en torno aos conceptos de Biodiversidade e Biodiversidade Terrestre, na planta baixa, e dos apartados dedicados a Xeodiversidade e Solo e Biodiversidade Mari&ntilde;a na primeira planta. As&iacute;, desde un &aacute;mbito multimedia, a exposici&oacute;n permanente do MHN &eacute; un singular percorrido por ecosistemas de augas continentais e bosques galegos ou pola xeodiversidade con mostras de minerais, pedras preciosas e semipreciosas, rocas, f&oacute;siles e meteoritos. Tam&eacute;n ten o seu propio espazo a biodiversidade mari&ntilde;a, as algas, os invertebrados, os peixes ou ecosistemas do litoral galego, e outros m&aacute;is afastados como a selva sudamericana ou a sabana africana.<br /><br />Ademais m&oacute;strase por vez primeira en Espa&ntilde;a unha sala dedicada ao solo, cunha reproduci&oacute;n a escala dun fragmento de terreo cortado en secci&oacute;n de modo que se poden apreciar distintos elementos que inciden na s&uacute;a conformaci&oacute;n ou a s&uacute;a relaci&oacute;n coa fauna e a flora.<br /><br />Cada un dos temas abordados m&oacute;strase ante o visitante cunha reproduci&oacute;n fiel que representa o ecosistema en cuesti&oacute;n e os seus protagonistas, con apoio das explicaci&oacute;ns oportunas en distintos formatos, para que a visita sexa unha experiencia interactiva que require da actitude participativa de quen a visita. O grao de reproduci&oacute;n da vida real alcanzado aspira a reflectir o medio natural e trasladar ao visitante ao contexto real do que se lle exp&oacute;n.</p> <p>&nbsp;</p>', '<p>Exp&oacute;n colecci&oacute;ns de zoolox&iacute;a, bot&aacute;nica e xeolox&iacute;a, con exemplares procedentes de Galicia e de outros puntos do planteta. Destaca a colecci&oacute;n Ha&uuml;y, que ilustra o inicio dos estudos cristalogr&aacute;ficos.</p>', 'España', 'Santiago de Compostela', 'Parque de Vistalegre', 'http://www.santiagoturismo.com/museos/museo-de-historia-natural-1', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000BFC3E55F681721C0D73C1E658A714540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (26, 'Sargadelos', 15705, '<p>Galer&iacute;a inaugurada en 1978 cunha exposici&oacute;n monogr&aacute;fica sobre o Seminario de Estudios Galegos. Mant&eacute;n dende ent&oacute;n unha actividade  continua na realizaci&oacute;n de exposici&oacute;ns e actos culturais, como conferencias, recitais, contacontos, presentaci&oacute;ns de  libros e outras actividades de difusi&oacute;n da cultura galega. Artellada como unha galer&iacute;a de promoci&oacute;n de novos talentos das artes e letras galegas, amosa ademais o valor da tradici&oacute;n creadora  de Galicia en colecci&oacute;ns de cer&aacute;micas de Sargadelos. Este tipo de cer&aacute;mica, unha iniciativa industrial nada a principios do s&eacute;culo XIX nas terras de Cervo (Lugo), pres&eacute;ntase nun ampl&iacute;simo  cat&aacute;logo de formas,  motivos, relevos e cores exclusivos, dende vaixelas ata figuras  ornamentais e xoias de dese&ntilde;o orixinal.</p> <p>Consulta tam&eacute;n a secci&oacute;n "Espazos e programadores culturais" <a href="http://www.santiagoturismo.com/programadores-culturais/galeria-sargadelos">aqu&iacute;</a></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa Nova 16', 'http://www.santiagoturismo.com/galerias-de-arte/sargadelos', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E61000005F9EE7B2451621C09CCF2D3289704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (2, 'Museo de Historia Natural Luís Iglesias', 15705, '<p><strong>Obra: Museo de Historia Natural Lu&iacute;s Iglesias.</strong><br /><strong>Arquitectos: C&eacute;sar Portela.</strong><br /><strong>Fecha: 2009-2011</strong><br /><strong>Situaci&oacute;n: Finca Sime&oacute;n. </strong><br /><strong>Visitas: http://www.usc.es/gl/servizos/museohn</strong><br /><br />A antiga colecci&oacute;n do <a href="http://www.santiagoturismo.com/museos/museo-de-historia-natural-1" target="_blank">Museo de Historia Natural da Universidade de Compostela</a>, iniciada en 1840, al&oacute;xase nun novo edificio, dese&ntilde;ado por C&eacute;sar Portela, situado un extremo do parque de Vista Alegre, delimitado polo r&iacute;o Sarela. <br /><br />O edificio, de traza lonxitudinal e baixa altura, estrutura os seus espazos expositivos de acordo coas catro principais secci&oacute;ns do museo, que se dedican&nbsp; &aacute; zoolox&iacute;a, bot&aacute;nica, xeolox&iacute;a e &aacute; antiga colecci&oacute;n de dioramas, restaurados para a s&uacute;a nova instalaci&oacute;n. <br /><br />O volume do museo conc&iacute;bese como un agrupamento de cubos que, no seu conxunto, se percibe como un artefacto en movemento, ao irse aproximando ou separando entre si. <br /><br />Toda a pel exterior do edificio de madeira, o que facilita a s&uacute;a integraci&oacute;n na paisaxe arborada do parque, e aporta ao edificio un significado de lixeireza e transitoriedade. As superficies de vidro modulan a entrada de luz por medio de lamas horizontais de madeira, que, ademais de control da luz, desdebuxan os amplos ocos na continuidade do material que cobre as fachadas. A sensaci&oacute;n de lixeireza que ofrece o museo acent&uacute;ase coa soluci&oacute;n do contacto do edificio co terreo, levemente separado do mesmo, como se flotase sobre o c&eacute;spede do parque.<br /><br />O espazo interior, de tons neutros e materiais moi livi&aacute;ns visualmente, dese&ntilde;ouse para albergar as antigas colecci&oacute;n do museo, &aacute;s que se sumar&aacute;n as novas, coa suficiente flexibilidade para non condicionar a evoluci&oacute;n futura dos seus contidos.</p>', '<p><strong>Arquitectos: C&eacute;sar Portela.</strong><br /><strong>Fecha: 2009-2011</strong><br /><strong>Situaci&oacute;n: Finca Sime&oacute;n.</strong></p>', 'España', 'Santiago de Compostela', 'Parque Vista alegre', 'http://www.santiagoturismo.com/arquitecturas-de-autor/museo-de-historia-natural-luis-iglesias', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E61000002E0AF5D3031721C0CD49FFFD6F714540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (24, 'Palacio de Congresos e Exposicións de Galicia', 15707, '<p>Arquitectos: Alberto Noguerol y Pilar D&iacute;ez.<br />Data: 1991-1995 <br />Zona: coroa exterior<br /><br />Cando se proxectou&nbsp;o Pazo de Congresos e Exposici&oacute;ns de Galicia, o seu emprazamento era unha zona da beira da cidade, con grandes &aacute;reas baleiras, cuxo conxunto presentaba un certo desorden. Este grande edificio sit&uacute;ase no terreo d&aacute;ndolle as costas &aacute; v&iacute;a de acceso e abrindo o seu p&oacute;rtico cara o interior do recinto no que se sit&uacute;a. Esta disposici&oacute;n &eacute; s&oacute; unha das sut&iacute;s e intelixentes ambig&uuml;idades que este edificio ofrece ao espectador.&nbsp;A s&uacute;a contundencia formal&nbsp;e a s&uacute;a claridade funcional revelan ao observador atento todo un rico mundo de segundas lecturas. <br /><br />O&nbsp;edificio conc&iacute;bese como un grande prisma baixo, pechado por grandes pezas de formig&oacute;n prefabricado, situando no seu centro dous grandes auditorios, de escenarios enfrontados, que se aloxan nun segundo prisma, forrado en pedra. Este volume sobresae por riba da envolvente exterior caracterizando a silueta do edificio. Arredor de este volume, contido dentro do per&iacute;metro exterior do edificio, x&eacute;rase un grande baleiro, que funciona como ambig&uacute; dos auditorios. Todas as salas de reuni&oacute;ns de menor tama&ntilde;o, a cafetar&iacute;a&nbsp;e diversos despachos, sit&uacute;anse nos laterais maiores do rect&aacute;ngulo da planta. <br /><br />Os elementos interiores des&eacute;&ntilde;anse con contundencia&nbsp;e elegancia, empregando exclusivamente&nbsp;a cor natural dos diferentes materiais: pedra listada, metal, madeira, etc.</p>', '<p>Arquitectos: Alberto Noguerol y Pilar D&iacute;ez.<br />Data: 1991-1995&nbsp;<br />Zona: coroa exterior</p>', 'España', 'Santiago de Compostela', 'Rúa de Miguel Ferro Caaveiro ', 'http://www.santiagoturismo.com/arquitecturas-de-autor/464', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000CDC5632FA90621C0E88A8CED39714540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (5, 'Durán Cuadros', 15706, '<p>Galer&iacute;a de arte especializada en pintura galega.</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa de Montero Ríos, 18', 'http://www.santiagoturismo.com/galerias-de-arte/483', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, NULL, '0101000020E610000064027E8D241921C0F93FD1860D704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (27, 'Noroeste', 15704, '<p>En Noroeste, a creatividade e o bo facer conx&uacute;ganse para ofrecer ao visitante xoias, sedas, obxectos de uso persoal e outros complementos. Pequenas obras de arte para usar e para gozar. Pezas que pola s&uacute;a singularidade, o seu depurado dese&ntilde;o e a s&uacute;a coidada manufactura artesanal seguen a ga&ntilde;ar valor co paso do tempo.</p> <p>Noroeste &eacute; un espazo dedicado &aacute; xoiar&iacute;a de autor. Unha xoiar&iacute;a creativa coidadosamente elaborada mediante procedementos artesanais, que reflicte a singularidade dos seus art&iacute;fices e se mergulla nas correntes est&eacute;ticas do noso tempo. Un espazo para todos os que senten alg&uacute;n interese pola xoiar&iacute;a. Pero tam&eacute;n para aqueles aos que ata agora nunca lles gustaron as xoias.<br /><br />Noroeste &eacute; o lugar onde encontrar as obras que deron nome aos nosos dese&ntilde;adores. Onde descubrir os primeiros pasos dos novos valores, onde co&ntilde;ecer o que se est&aacute; a facer aqu&iacute; e agora no campo da xoiar&iacute;a de creaci&oacute;n, pero tam&eacute;n o que fixeron autores doutros lugares e doutros tempos. Porque Noroeste abriga a audaz intenci&oacute;n de somerxer a quen o visita no universo m&aacute;xico da forma, de contaxiar a todos o entusiasmo da xente que se empe&ntilde;a cada d&iacute;a en reinventar unha arte tan vella como o home.</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa Travesa, 5 baixo', 'http://www.santiagoturismo.com/galerias-de-arte/noroeste', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000F0CB2E52071521C0588E6F73D3704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (28, 'El Taller', 15701, '<p>El taller &eacute; unha galer&iacute;a de arte con vocaci&oacute;n de aula. Creado baixo a premisa de que se goza m&aacute;is o que se entende, quere ofrecer aos seus clientes a oportunidade de adquirir os co&ntilde;ecementos necesarios sobre diferentes disciplinas art&iacute;sticas, creativas, culturais e cient&iacute;ficas, para comprender o que hai detr&aacute;s de cada creaci&oacute;n: formaci&oacute;n, inspiraci&oacute;n e traballo.<br /><br /><br /></p>', '<p>El taller &eacute; unha galer&iacute;a de arte con vocaci&oacute;n de aula. Creado baixo a  premisa de que se goza m&aacute;is o que se entende, quere ofrecer aos seus  clientes a oportunidade de adquirir os co&ntilde;ecementos necesarios sobre  diferentes disciplinas art&iacute;sticas, creativas, culturais e cient&iacute;ficas,  para comprender o que hai detr&aacute;s de cada creaci&oacute;n: formaci&oacute;n,  inspiraci&oacute;n e traballo.</p>', 'España', 'Santiago de Compostela', 'Avenida de Rosalía de Castro, 34', 'http://www.santiagoturismo.com/galerias-de-arte/el-taller', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E610000055C2137AFD1921C09F8F32E202704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (29, 'Mareiras Espacio de Arte', 15704, '<p>Espazo de intercambio, aprendizaxe e creaci&oacute;n, dispo&ntilde;ible para todas aquelas persoas que desexen achegarse ao mundo da arte e vivir na s&uacute;a propia pel un proceso creativo.</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa do Preguntoiro 9', 'http://www.santiagoturismo.com/galerias-de-arte/mareiras-spacio-de-arte', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E61000002F952B7AAF1521C03A19C16BBC704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (30, 'Aire Centro de Arte', 15703, '<p>Aire Centro de Arte &eacute; un espazo para crear e crecer, con obradoiros   m&uacute;ltiples de artes pl&aacute;sticas, co&ntilde;ecemento emocional e sensorial, nos que   alimentaredes o voso esp&iacute;rito e o dos m&aacute;is pequenos. Exposici&oacute;ns mensuais de artistas contempor&aacute;neos.<br /><br />Situado no casco hist&oacute;rico, est&aacute; aberto a todo tipo de propostas e docencias que abran as vosas &aacute;s.<br /><br />Direcci&oacute;n e docencia en mans de artistas, psic&oacute;logos, m&uacute;sicos e profesionais de nivel internacional.</p>', '<p>Aire Centro de Arte &eacute; un espazo para crear e crecer, con obradoiros   m&uacute;ltiples de artes pl&aacute;sticas, co&ntilde;ecemento emocional e sensorial, nos que   alimentaredes o voso esp&iacute;rito e o dos m&aacute;is pequenos. Exposici&oacute;ns mensuais de artistas contempor&aacute;neos.</p>', 'España', 'Santiago de Compostela', 'Rúa da Caldeirería, 50', 'http://www.santiagoturismo.com/galerias-de-arte/aire-centro-de-arte', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000D022A14EF51521C0AB88058477704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (31, 'Espacio de Arte Campus Stellae', 15704, '<p>Situado no centro hist&oacute;rico de Santiago de Compostela, o Espazo de Arte Campus Stellae mostra colecci&oacute;ns nacionais e internacionais promovendo as diversas disciplinas art&iacute;sticas. O espazo est&aacute; vinculado ao Instituto Europeo Campus Stellae, que &eacute; pioneiro na formaci&oacute;n de postgrao online e presencial dende hai vinte anos, e conta con alumnos en m&aacute;is de 60 pa&iacute;ses.</p>', ' ', 'España', 'Santiago de Compostela', 'Praza da Quintana de Vivos 3', 'http://www.santiagoturismo.com/galerias-de-arte/espacio-de-arte-campus-stellae', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000739B15F6591621C09830DCB1BF704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (3, 'Galería de Arte Luisa Pita', 15703, '<p style="text-align: justify;">O novo proxecto da ''Galer&iacute;a de Arte Luisa Pita'', nace como unha continuidade da actividade que a Galer&iacute;a Bus Station Space, fundada e dirixida por Luisa Pita, vi&ntilde;a desenvolvendo en Santiago de Compostela desde o ano 2012.</p> <p style="text-align: justify;">Enfocado agora desde a experiencia adquirida como un proxecto cultural m&aacute;is ambicioso, cun significado propio e persoal, nun novo espazo expositivo e como punto de encontro para a arte entre artistas de reco&ntilde;ecido prestixio e outros emerxentes.</p>', '<p style="text-align: justify;"><span>O novo proxecto da ''Galer&iacute;a de Arte Luisa Pita'', nace como unha continuidade da actividade que a Galer&iacute;a Bus Station Space, fundada e dirixida por Luisa Pita, vi&ntilde;a desenvolvendo en Santiago de Compostela desde o ano 2012.</span></p>', 'España', 'Santiago de Compostela', 'Rúa do Cardeal Payá, 9', 'http://www.santiagoturismo.com/galerias-de-arte/galeria-de-arte-luisa-pita', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000862DA835EE1521C0269862F564704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (4, 'Galería Nordés', 15704, '<p>A Galer&iacute;a Nord&eacute;s, inaugurada en decembro de 2017, &eacute; a m&aacute;is nova do panorama art&iacute;stico da cidade. Espazo dedicado &aacute; arte contempor&aacute;nea nas s&uacute;as m&uacute;ltiples manifestaci&oacute;ns, busca xerar un entorno apropiado para diversos proxectos art&iacute;sticos, prestando especial atenci&oacute;n aos novos creadores e establecendo relaci&oacute;ns de colaboraci&oacute;n con outros profesionais do sector, para trascender as&iacute; os propios l&iacute;mites f&iacute;sicos do espazo da galer&iacute;a.</p>', '<p>A Galer&iacute;a Nord&eacute;s, inaugurada en decembro de 2017, &eacute; a m&aacute;is nova do panorama art&iacute;stico da cidade. Espazo dedicado &aacute; arte contempor&aacute;nea nas s&uacute;as m&uacute;ltiples manifestaci&oacute;ns, busca xerar un entorno apropiado para diversos proxectos art&iacute;sticos, prestando especial atenci&oacute;n aos novos creadores e establecendo relaci&oacute;ns de colaboraci&oacute;n con outros profesionais do sector, para trascender as&iacute; os propios l&iacute;mites f&iacute;sicos do espazo da galer&iacute;a.</p>', 'España', 'Santiago de Compostela', 'Rúa da Algalia de Abaixo, 39', 'http://www.santiagoturismo.com/galerias-de-arte/nordes', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000A4B55840571521C006D7DCD1FF704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (6, 'Trinta', 15703, '<p>A Galer&iacute;a Trinta existe dende 1985. Dende os seus inicios orientou a s&uacute;a actividade &aacute; exhibici&oacute;n e promoci&oacute;n dos artistas m&aacute;is comprometidos coa linguaxe pl&aacute;stica do seu tempo. Santiago de Compostela &eacute; a cidade que acolleu as s&uacute;as exposici&oacute;ns nas que as m&aacute;is diversas manifestaci&oacute;ns pl&aacute;sticas tiveron cabida.</p> <p>Artistas como Ignacio Basallo, Eva Lootz, Jos&eacute; Freixanes, Thomas Jocher, Manolo Paz, Florentino D&iacute;az, Jorge Barbi, Perejaume, Berta C&aacute;ccamo, Elena Blasco, Vari Caram&eacute;s, Alberto Garc&iacute;a-Alix, Xes&uacute;s V&aacute;zquez, Miquel Mont, Pamen Pereira, Carlos Pazos, Alicia Mart&iacute;n, Antonio Murado... entre outros, fixeron do espazo da galer&iacute;a o seu lugar de traballo para amosar ao p&uacute;blico o mellor dos seus talleres.</p> <p>&nbsp;</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa da Virxe da Cerca 24', 'http://www.santiagoturismo.com/galerias-de-arte/trinta', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E610000023469582EA1421C0A72EF04797704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (7, 'Paloma Pintos', 15704, '<p>A Galer&iacute;a Paloma Pintos realiza exposici&oacute;ns de diversos &aacute;mbitos art&iacute;sticos e culturais en Santiago de Compostela.</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa de Xelmírez 25', 'http://www.santiagoturismo.com/galerias-de-arte/paloma-pintos', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000C6DA4204DA1521C02380400C99704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (8, 'Galería de Arte Contemporáneo José Lorenzo', 15705, '<p>A Galer&iacute;a de Arte Contempor&aacute;neo Jos&eacute; Lorenzo naceu en 2005 na praza  do Toural como extensi&oacute;n da galer&iacute;a do mesmo nome, despois de once  anos de traxectoria profesional, como demanda de clientes e artistas.  Disp&oacute;n dun amplo espazo expositivo dividido en tres &aacute;reas: un &aacute;rea  dedicada a exposici&oacute;ns temporais, un fondo de galer&iacute;a dedicado a  pintura do s&eacute;culo XX e un xard&iacute;n no que se realizan exposici&oacute;ns de  escultores contempor&aacute;neos de marcado prestixio. Centra o seu interees na  promoci&oacute;n e difusi&oacute;n da arte contempor&aacute;nea, as&iacute; como na divulgaci&oacute;n  da obra de mestres modernos. Colabora con diferentes galer&iacute;as e  instituci&oacute;ns p&uacute;blicas e privadas.</p>', ' ', 'España', 'Santiago de Compostela', 'Praza do Toural, 9, 1º', 'http://www.santiagoturismo.com/galerias-de-arte/jose-lorenzo-de-arte-contemporaneo', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E61000007DD4DB760C1721C0C0DB51D64E704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (9, 'Metro Arte Contemporáneo', 15701, '<p>Tras 10 anos na emblem&aacute;tica&nbsp; Praza da Quintana de Santiago de  Compostela, a Galer&iacute;a Metro comeza unha nova etapa en 2018 na R&uacute;a&nbsp;  Xeneral Pardi&ntilde;as do Ensanche compostel&aacute;n, coa intenci&oacute;n de ocupar un  baleiro nesta importante zona residencial e comercial da cidade,  ofrecendo unha programaci&oacute;n de calidade que dar&aacute; cabida &aacute; arte m&aacute;is  actual.</p>', '<p>Tras 10 anos na emblem&aacute;tica&nbsp; Praza da Quintana de Santiago de Compostela, a Galer&iacute;a Metro comeza unha nova etapa en 2018 na R&uacute;a&nbsp; Xeneral Pardi&ntilde;as do Ensanche compostel&aacute;n, coa intenci&oacute;n de ocupar un baleiro nesta importante zona residencial e comercial da cidade, ofrecendo unha programaci&oacute;n de calidade que dar&aacute; cabida &aacute; arte m&aacute;is actual.</p>', 'España', 'Santiago de Compostela', 'Rúa do Xeneral Pardiñas, 12-16, L14', 'http://www.santiagoturismo.com/galerias-de-arte/metro-arte-contemporaneo', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000CA37BACEAF1721C0B1C2CAF40D704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (16, 'Museo-Fundación Eugenio Granell', 15705, '<p>A Fundaci&oacute;n Eugenio Granell inicia a s&uacute;a andaina en 1995 trala sinatura dun convenio entre o artista surrealista Eugenio Granell e o Concello de Santiago. Con sede no Pazo de Benda&ntilde;a, na c&eacute;ntrica praza compostel&aacute; do Toural, a Fundaci&oacute;n alberga obras do propio artista, as s&uacute;as colecci&oacute;ns surrealista e &eacute;tnica e, a partir do ano 1997 as obras doadas polo artista surrealista ingl&eacute;s Philip West, quen tam&eacute;n nos legou a s&uacute;a colecci&oacute;n de libros surrealistas. <br /><br />O fin primordial da Fundaci&oacute;n &eacute; a difusi&oacute;n do conxunto da obra de Granell e o fomento do estudio do surrealismo e de correntes af&iacute;ns. No primeiro andar do pazo, formado por tres salas, exp&oacute;&ntilde;ense con car&aacute;cter temporal fondos da Fundaci&oacute;n que, por falta de espacio, non poden estar expostos durante todo o ano. <br />A segunda planta ten tam&eacute;n outras tres salas dedicadas a exposici&oacute;ns temporais. Desde o inicio ofrec&eacute;ronse ao p&uacute;blico exposici&oacute;ns de artistas tan importantes como Man Ray, Max Ernst, Esteban Frances, Gordon Onslow Ford, Jos&eacute; Hern&aacute;ndez e artistas galegos como Xes&uacute;s Carballido ou Paco Pestana. <br /><br />Ademais desta actividade relacionada estrictamente co mundo da arte, &eacute; desexo da Fundaci&oacute;n converterse nun lugar de creaci&oacute;n e promoci&oacute;n cultural. As&iacute;, a trav&eacute;s do Departamento Pedag&oacute;xico organiza obradoiros, visitas guiadas e actividades para escolares e colectivos de todas as idades que o soliciten; conta ademais cos Amigos Infant&iacute;s e Xuven&iacute;s, aos que se lles ofrece unha programaci&oacute;n especial cada mes. <br />O Departamento Cultural organiza outra serie de actividades entre as que se atopan concertos, teatro, recitais de poes&iacute;a, conferencias...</p> <p>A Fundaci&oacute;n disp&oacute;n dunha tenda e dunha biblioteca especializada en surrealismo. Calquera persoa ou entidade pode colaborar a trav&eacute;s de Amigos da Fundaci&oacute;n.</p>', '<p>A trav&eacute;s da obra e do legado que Granell deixou, a s&uacute;a fundaci&oacute;n mant&eacute;n viva a esencia das diferentes formas de expresi&oacute;n surrealista.</p>', 'España', 'Santiago de Compostela', 'Praza do Toural 8', 'http://www.santiagoturismo.com/museos/museo-fundacion-eugenio-granell', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E61000001125949D021721C053C8F8A451704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (17, 'Casa de la Troya', 15782, '<p><strong>&nbsp;</strong>Este museo recrea o ambiente estudiantil da afamada pensi&oacute;n rexentada por dona Generosa en Santiago de Compostela a finais do s&eacute;culo XIX, e inmortalizada polo escritor Alejandro P&eacute;rez Lug&iacute;n na s&uacute;a novela La Casa de la Troya.</p> <p>&Eacute; unha t&iacute;pica construcci&oacute;n do casco antigo da cidade, edificada a mediados do s&eacute;culo XVIII e decorada ao gusto daquela &eacute;poca. Consta de tres plantas e dun pequeno &aacute;tico que remata a casa. A entrada est&aacute; formada por un <strong>vest&iacute;bulo</strong> ou zona de paso e desde este lugar a casa div&iacute;dese en d&uacute;as zonas ben diferenciadas: a vivenda propiamente dita e as <strong>cuadras dos cabalos</strong>.</p> <p>Entrando na pensi&oacute;n podemos ver a <strong>sala de respecto</strong>, con lembranzas do escritor, e o <strong>comedor</strong>, onde est&aacute;n expostas fotograf&iacute;as e obxectos relacionados cos personaxes do libro. No segundo piso, os <strong>dormitorios</strong>, tanto do colectivo como do individual. E no &aacute;tico, a <strong>coci&ntilde;a</strong> e un <strong>pequeno cuarto</strong> anexo, pertencente &aacute; patroa.</p> <p><span><strong><br /></strong></span></p> <p><strong>&nbsp;</strong></p> <p>&nbsp;</p> <p>&nbsp;</p>', '<p>Esta casa-museo reproduce o ambiende dunha pensi&oacute;n estudiantil de finais do s&eacute;c. XIX, sendo o seu referente literario a pensi&oacute;n da novela <em>La Casa de la Troya</em>, de P&eacute;rez Lug&iacute;n.&nbsp;</p>', 'España', 'Santiago de Compostela', 'Rúa da Troia, 5', 'http://www.santiagoturismo.com/museos/casa-da-troia', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000BE33DAAA241621C08DC41561D4704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (19, 'Colección do Colexio Médico', 15782, '<p>Localizado na Facultade de Medicina de Santiago, este pequeno museo monogr&aacute;fico am&oacute;sanos nas s&uacute;as vitrinas o antigo instrumental utilizado na especialidade m&eacute;dica de anestesiolox&iacute;a.</p> <p>A maior&iacute;a dos seus fondos son froito de doaz&oacute;ns que ao longo dos anos realizaron prestixiosos m&eacute;dicos tanto galegos como compostel&aacute;ns. Nalgunhas vitrinas m&oacute;stranse unha serie de gravados da &eacute;poca nos que se pode ver c&oacute;mo se utilizaba este instrumental, as&iacute; como as fotograf&iacute;as de prestixiosos doutores galegos.<br /><br /><br /><br /><br /><br /><br /><br /></p>', '<p>Localizado na Facultade de Medicina de Santiago, este pequeno museo monogr&aacute;fico am&oacute;sanos nas s&uacute;as vitrinas o antigo instrumental utilizado na especialidade m&eacute;dica de anestesiolox&iacute;a.</p>', 'España', 'Santiago de Compostela', 'Facultade de Medicina, Rúa de San Francisco', 'http://www.santiagoturismo.com/museos/museo-do-colexio-medico', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000DA12C151551721C0C90B9F63F6704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (20, 'Parque da Finca do Espiño', 15705, '<p>Os 18.000 metros cadrados da Finca do Espi&ntilde;o atesouran unha importante riqueza bot&aacute;nica e zool&oacute;xica. Neste parque, inaugurado en agosto de 2014, poden contemplarse camelios de m&aacute;is de 80 anos, as&iacute; como unha carballeira con 250 exemplares &mdash;alg&uacute;ns con m&aacute;is dun s&eacute;culo de antig&uuml;idade&mdash;, 100 acivros, unha picea de Noruega e unha grande araucaria. Casta&ntilde;os, magnolios, numerosos arbustos e plantas florais completan, xunto &aacute;s ru&iacute;nas dun palacete de estilo neog&oacute;tico, os atractivos deste espazo recuperado.<br /><br />O parque conta ademais cunha zona lacustre &mdash;recicla a auga da chuvia para abastecer o sistema de rego&mdash; e merendeiros.<br /><br /><em>Horario de apertura</em><br />- Ver&aacute;n (abril-setembro): De 8:00 a 23:00 h.<br />- Inverno (outubro-marzo): De 8:00 a 20:00 h.</p>', '<p>Os 18.000 metros cadrados da Finca do Espi&ntilde;o atesouran unha importante riqueza bot&aacute;nica e zool&oacute;xica. Neste parque, inaugurado en agosto de 2014, poden contemplarse camelios de m&aacute;is de 80 anos, as&iacute; como unha carballeira con 250 exemplares &mdash;alg&uacute;ns con m&aacute;is dun s&eacute;culo de antig&uuml;idade&mdash;, 100 acivros, unha picea de Noruega e unha grande araucaria. Casta&ntilde;os, magnolios, numerosos arbustos e plantas florais completan, xunto &aacute;s ru&iacute;nas dun palacete de estilo neog&oacute;tico, os atractivos deste espazo recuperado.</p>', 'España', 'Santiago de Compostela', 'Finca do Espiño ', 'http://www.santiagoturismo.com/parques-e-xardins/parque-de-la-finca-do-espino', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000B3E2026DFE1921C0FD221584FA704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (21, 'Centro Abanca Obra Social', 15782, '<p><span>Situado nun edificio de finais do s&eacute;culo XIX, na c&eacute;ntrica <span class="unknown">Praza de Cervantes</span>, disp&oacute;n de tres salas de exposici&oacute;ns. Alberga a primeira exposici&oacute;n permanente de arte  galega en Compostela.</span></p>', ' ', 'España', 'Santiago de Compostela', 'Praza de Cervantes, s/n', 'http://www.santiagoturismo.com/salas-de-exposicions/centro-abanca-obra-social', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E61000003F32C280CA1521C00A95C9BAC9704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (22, 'Casa do Cabido', 15782, '<p>Con s&oacute; catro metros de profundidade e unha finalidade puramente  escenogr&aacute;fica na s&uacute;a concepci&oacute;n (como cerramento da Praza de Prater&iacute;as),  a Casa do Cabido &eacute; un dos edificios m&aacute;is singulares do casco hist&oacute;rico  compostel&aacute;n. Foi dese&ntilde;ada polo arquitecto Clemente Fern&aacute;ndez Sarela en  1758. &Eacute; un dos m&aacute;is fermosos exemplos de arquitectura barroca de toda a  comunidade galega.<br /><br />A Casa do Cabido foi restaurada polo Consorcio  de Santiago no ano 2011 e dende ent&oacute;n forma parte da rede de museos da  cidade hist&oacute;rica.</p> <p>Ver tam&eacute;n:</p> <p><a href="http://www.santiagoturismo.com/museos/museo-da-cidade-e-das-peregrinacions">Museo das Peregrinaci&oacute;ns e de Santiago (Banco de Espa&ntilde;a)</a></p> <p><a href="http://www.santiagoturismo.com/museos/museo-das-peregrinacions">Museo das Peregrinaciones (Casa G&oacute;tica)</a></p>', ' ', 'España', 'Santiago de Compostela', 'Plaza de las Platerías, 2', 'http://www.santiagoturismo.com/salas-de-exposicions/casa-do-cabido-4', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E61000006D814E52AA1621C029D3C32BA4704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (23, 'Espacio de Arte Grupo Correo Gallego', 15782, '<p>Inaugurado en xu&ntilde;o de 2001, o Espacio de Arte do Grupo Correo Galego acolle diversas exposici&oacute;ns e mostras de car&aacute;cter temporal, de todas as vertentes art&iacute;sticas, cuxo obxectivo primordial &eacute; homenaxear tanto aos valores consagrados coma &aacute;s xeraci&oacute;ns emerxentes. Polo Espazo, que busca a confluencia entre a arte, a empresa xornal&iacute;stica e os lectores, te&ntilde;en pasado m&aacute;is de medio centenar de artistas.<br /><br />Comisariado por Piar Corredoira, nas instalaci&oacute;ns colgouse a obra de autores de reco&ntilde;ecido prestixio como Quintana Martelo, Alfonso Costa, Acisclo Manzano, Jos&eacute; Mar&iacute;a Barreiro, Jorge Peteiro, Vari Caram&eacute;s ou Antonio Garc&iacute;a Pati&ntilde;o, entre outros moitos.<br /><br />A sala converteuse, ademais, nunha ponte que permite achegar &aacute; cidadan&iacute;a o labor do Grupo e as s&uacute;as contribuci&oacute;ns ao desenvolvemento social.</p>', '<p>Inaugurado en xu&ntilde;o de 2001, o Espacio de Arte do Grupo Correo Galego  acolle diversas exposici&oacute;ns e mostras de car&aacute;cter temporal, de todas as  vertentes art&iacute;sticas, cuxo obxectivo primordial &eacute; homenaxear tanto aos  valores consagrados coma &aacute;s xeraci&oacute;ns emerxentes. Polo Espazo, que busca  a confluencia entre a arte, a empresa xornal&iacute;stica e os lectores, te&ntilde;en  pasado m&aacute;is de medio centenar de artistas.</p>', 'España', 'Santiago de Compostela', 'Rúa do Preguntoiro, 29', 'http://www.santiagoturismo.com/salas-de-exposicions/espacio-de-arte-grupo-correo-gallego', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E6100000BFCC1C37A11521C04FAA2281AB704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (25, 'Igrexa da Compañía (Universidade)', 15703, '<p>Atesoura valiosos retablos barrocos no seu interior, entre os que destaca o retablo maior, de Sim&oacute;n Rodr&iacute;guez. &Uacute;sase activamente como sala de exposici&oacute;ns organizadas pola Universidade.</p>', ' ', 'España', 'Santiago de Compostela', 'Praza da Universidade', 'http://www.santiagoturismo.com/salas-de-exposicions/igrexa-da-compania-universidade', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', NULL, 0, 0, '0101000020E610000017EA5509BB1521C033969F0A6E704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (15, 'Mosteiro e Igrexa de San Martiño Pinario', 15704, 'O complexo, que ocupa uns 20.000 metros cadrados, é un dos maiores edificios deste tipo en España e actualmente alberga o Seminario Maior e un establecemento hoteleiro. Ademais, ten un museo cunha exposición permanente, incluída a igrexa con retablos e os postos do coro.', 'O complexo, que ocupa uns 20.000 metros cadrados, é un dos maiores edificios deste tipo en España e actualmente alberga o Seminario Maior e un establecemento hoteleiro. Ademais, ten un museo cunha exposición permanente, incluída a igrexa con retablos e os postos do coro. Este mosteiro xorde na praza da Inmaculada, fundado por un grupo de beneditinos que, pouco despois do descubrimento dos restos do apóstolo, instaláronse nun lugar chamado Pignario, preto da capela de Corticela (hoxe integrada na catedral)., onde celebraron os seus oficios. O maior desenvolvemento comezou cando en 1494 pasou a depender da congregación beneditina de Valladolid. A partir de aquí alcanzarán a riqueza que lles permitirá pagar as impoñentes obras da igrexa, que constitúe, xunto coa Catedral, a colección máis valiosa do barroco galego. Durante 1991, despois de reformar as salas monásticas e limpar e restaurar os valiosos retablos, acolleu a exposición antolóxica de arte galega ''Galicia no tempo''. No 2000, cando Santiago celebrou a súa capital cultural, acolleu a exposición ''As Faces de Deus''. Para saber máis sobre este lugar de interese turístico, recomendámoslle que visite a súa páxina web.', 'España', 'Santiago de Compostela', 'Plaza de San Martiño', 'https://www.espacioculturalsmpinario.com/exposiciones-temporales/', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', 'san_martino_pinairo', 60, 4, '0101000020E6100000CFDF000A601621C0740CC85EEF704540', 90, 15, 'Recoméndase a visita pola monumental Igrexa do Monasteiro, do Claustro Procesional e a Escalera Abacial.', 'Recoméndase a visita pola monumental Igrexa do Monasteiro, o Museo do Monasteiro, do Claustro Procesional e a Escalera Abacial. Inclúese tamén a visita á área museística e de exposicións permanentes, así como de outras exposicións temporais que podan existir no lugar.', 'Todos os días de 11:00-19:00 (xuño a outubro 10:00 a 20:00)', 4, 3);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (13, 'Museo das Peregrinacións e de Santiago', 15704, 'O Museo das Peregrinacións e de Santiago é un complexo museístico creado en Santiago de Compostela en 1951 e dedicado ao feito cultural da peregrinación, no contexto do Camiño de Santiago, a catedral e o fenómeno xacobeo da tumba do Apóstolo Santiago. Foi declarado Ben de Interese Cultural en 1985.', 'O Museo das Peregrinacións e de Santiago ocupa o edificio do antigo Banco de España, proxectado en 1939 polo arquitecto Romualdo Madariaga Céspedes e construído na parcela das casas Espinosa. Está situado na praza de Platerías, a poucos metros da fachada sur da catedral. Na súa planta baixa hai 5 arcos sobre columnas que forman soportais. Cos seus case 3.500 metros cadrados de superficie construída, a antiga sede do Banco de España na cidade forma parte deste o complexo museístico desde xullo de 2012 xunto coa Casa do Cabido. Desde a gran claraboia do segundo andar pódese ver a basílica compostelá coa súa impresionante torre Berenguela e gran parte do centro histórico.', 'España', 'Santiago de Compostela', 'Praza de Praterías', 'http://www.santiagoturismo.com/arquitecturas-de-autor/museo-de-las-peregrinaciones-y-de-santiago', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', 'museo_peregrinacions', 45, 5, '0101000020E6100000358A17D1971621C00CCFC78CA2704540', 90, 0, 'Inclúe unha visita detallada de todo o museo, con detemento en cada sala.', 'Trátase dunha visita superficial do museo, únicamente recomendable cando se accede gratuitamente. Para ver cando isto é posible acceda á páxina web oficial do museo.', 'Martes a venres, de 9:30 a 20:30. Sábados de 11:00 a 19:30. Domingos e festivos, de 10:15 a 14:45.', 2.4, 1.2);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (10, 'Parque da Alameda - Paseo da Ferradura', 15705, 'O miradoiro urbano máis coñecido e admirado é o paseo da Ferradura, situado no parque da Alameda, no lado oriental do outeiro de Santa Susana. Desde alí, unha espectacular vista frontal da catedral sobresaíndo magnífica entre a masa de edificios históricos.', 'O miradoiro urbano máis coñecido e admirado é o paseo da Ferradura, situado no parque da Alameda, no lado oriental do outeiro de Santa Susana. Desde alí, unha espectacular vista frontal da catedral sobresaíndo magnífica entre a masa de edificios históricos: é a postal máis retratada, a imaxe máis atemporal da cidade. Recomendado a calquera hora do día, este punto de vista é esencial pola noite para comprender verdadeiramente por que a catedral foi e será un "faro" espiritual.', 'España', 'Santiago de Compostela', 'Paseo dos Leóns', 'http://www.santiagoturismo.com/miradoiros/parque-da-alameda-paseo-da-ferradura', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', 'paseo_ferradura', 5, 0, '0101000020E6100000A5677A89B11821C061A92EE065704540', 15, 0, 'Recoméndase a visualización da Catedral de Santiago de Compostela e do resto de vistas dende o mirador.', 'Recoméndase a visualización fundamentalmente da Catedral de Santiago de Compostela dende o mirador, así como de toda a vista que se pode ver dende o mesmo. Inclúese nesta visita a realización de fotografías. O tempo pode ascender dependendo da cantidade de xente. Os 15 minutos son aproximados con non demaisada cantidade de xente.', 'Lugar público, sen horario', 0, 0);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (14, 'Museo Centro Gaiás', 15702, 'Chamado a ser un referente arquitectónico do século XXI, o Museo Centro Gaiás é un dos edificios máis singulares e con máis posibilidades de uso na Cidade da Cultura, que aspira a converterse no centro expositivo de referencia en Galicia.', 'Chamado a ser un referente arquitectónico do século XXI, o Museo Centro Gaiás é un dos edificios máis singulares e con máis posibilidades de uso na Cidade da Cultura, que aspira a converterse no centro expositivo de referencia en Galicia. A espectacularidade da súa fachada, os case 43 metros de altura e os seus máis de 16.000 metros cadrados de superficie permiten ao Museo Centro Gaiás amosar unha serie de actividades formativas e divulgativas que o converten nun centro activo en continua renovación. O Museo Centro Gaiás ten unha superficie expositiva de 6.600 metros cadrados, dividida en tres plantas, na que alberga exposicións temporais de gran profundidade e instalacións que, polo seu tamaño, non se puideron exhibir noutros centros culturais de Galicia. O edificio ten un servizo de cafetería-restaurante situado na planta 0, xunto ao Salón Tirantes. Este espazo gastronómico está aberto de luns a domingo de 8:00 a 20:00 e ten dúas terrazas, unha exterior e outra interior no propio vestíbulo do museo.', 'España', 'Santiago de Compostela', 'Cidade da Cultura', 'http://www.santiagoturismo.com/museos/museo-centro-gaias', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', 'museo_centro_gaias', 90, 0, '0101000020E6100000C3F651156C0E21C0A71212277F6F4540', 240, 0, 'Inclúese a visita ao edificio e a súa visualización, e a visita a unha das exposicións existentes.', 'Inclúese a visita ao edificio e a súa visualización con detemento, así como a visita á maior parte das exposicións que se atopen no edificio nese intre.', 'Luns a domingo de 8:00 a 20:00', 0, 0);
INSERT INTO fresh_tour.lugares_turisticos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (11, 'Monte Pedroso', 15898, 'O monte Pedroso, no oeste, é o máis emblemático da cidade. Protexido durante anos da construción para que ningún edificio poida competir nunca en altura ou visibilidade coa Basílica do Apóstolo, é o miradoiro por excelencia para descubrir a cidade cubrindo a paisaxe e a catedral que dá ao solpor.', 'O monte Pedroso, no oeste, é o máis emblemático da cidade. Protexido durante anos da construción para que ningún edificio poida competir nunca en altura ou visibilidade coa Basílica do Apóstolo, é o miradoiro por excelencia para descubrir a cidade cubrindo a paisaxe e a catedral que dá ao solpor. Calquera hora é boa para subir alí, pero ao solpor é especial, porque é cando os últimos raios dourados da tarde se reflicten no templo. Dende a cidade, pódese acceder ao pico do Pedroso nun paseo duns 40 minutos que sae de Ponte Asén, no parque das Galeras, e atravesa a aldea de Casas Novas, para continuar polo camiño ascendente marcado polo Vía Crucis. Para chegar en coche, tome a estrada que comeza no Carme de Abaixo e logo tome o desvío á dereita, seguindo as indicacións dos repetidores de televisión.', 'España', 'Santiago de Compostela', 'Carretera do Pedroso ', 'http://www.santiagoturismo.com/miradoiros/monte-pedroso', '2021-03-30 17:04:40.51828', '2021-03-30 17:04:40.51828', 'monte_pedroso', 80, 0, '0101000020E610000013EAF194382121C03C4B144AF4724540', 180, 0, 'Na visita rápida recoméndase unha estancia no alto do monte de 30 minutos (40 minutos son de subida a pé), para poder visualizar tranquilamente as súas vistas e descansar.', 'Na visita lenta recoméndase unha estancia no alto do monte de máis de dúas horas, para poder disfrutar en plenitude de todo o que ofrece o alto do monte e os seus arredores (40 minutos son de subida a pé).', 'Lugar público, sen horario', 0, 0);
