INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (6, 'Casa do Cabido', 15704, '<p>Mediados s. XVIII. Barroco. <br /><br />Esta fachada ornamental de poco m&aacute;s de tres metros de fondo y levantada frente a la Puerta de Plater&iacute;as cierra la hermosa plaza en la que se asienta. Fue construida en 1758 por el arquitecto Clemente Fern&aacute;ndez Sarela con una funci&oacute;n puramente teatral: la de cerrar la plaza. Est&aacute; considerada como una de las intervenciones de escenograf&iacute;a barroca gallega m&aacute;s importantes y conocidas.</p> <p>Restaurada en 2011 por iniciativa del Consorcio de Santiago, la Casa do  Cabido ha pasado a formar parte del n&uacute;cleo muse&iacute;stico de la ciudad  hist&oacute;rica, junto con el Museo das Peregrinaci&oacute;ns y el de Santiago. La  exposici&oacute;n inaugural, ''Compostela Dicitur'', ofrec&iacute;a un recorrido por la  Compostela de 1211, con motivo de la celebraci&oacute;n del 800 aniversario de  la consagraci&oacute;n de la Catedral.</p>', '<p>Mediados s. XVIII. Barroco.&nbsp;Esta fachada ornamental de poco m&aacute;s de tres metros de fondo y levantada frente a la Puerta de Plater&iacute;as cierra la hermosa plaza en la que se asienta. Fue construida en 1758 por el arquitecto Clemente Fern&aacute;ndez Sarela con una funci&oacute;n puramente teatral: la de cerrar la plaza. Est&aacute; considerada como una de las intervenciones de escenograf&iacute;a barroca gallega m&aacute;s importantes y conocidas.</p>', 'España', 'Santiago de Compostela', 'Praza das Praterías', 'http://www.santiagoturismo.com/monumentos/casa-do-cabido-2', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 5, '0101000020E6100000E626073FB31621C037E0D2B59F704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (8, 'Antiguo Hospital e Iglesia de San Roque', 15704, '<p>HOSPITAL s. XVI.</p> <p>En lo alto de R&uacute;a das Rodas, donde comienza R&uacute;a de San Roque, nos encontramos con este edificio originario del siglo XVI y transformado en el XVIII. Se levant&oacute; con fines asistenciales debido a las epidemias de peste del siglo XVI, dedic&aacute;ndose a San Roque por ser este uno de los santos m&aacute;s evocados para proteger contra esa enfermedad. Del siglo XVI conserva la fachada renacentista atribuida a Gaspar de Arce. Su estructura cuenta con planta rectangular y un claustro de dos galer&iacute;as.<br /><br />IGLESIA s. XVIII. Barroca.</p> <p>Formando conjunto con el hospital, est&aacute; la Iglesia de San Roque, de planta tambi&eacute;n rectangular y de estilo barroco. En su interior acoge uno de los m&aacute;s importantes retablos de Sim&oacute;n Rodr&iacute;guez.</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa de San Roque 2', 'http://www.santiagoturismo.com/monumentos/antigo-hospital-e-igrexa-de-san-roque-7', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000521E69B2771521C03E132F8912714540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (7, 'Monasterio e Iglesia de San Martiño Pinario', 15704, '<p>En la Plaza de la Inmaculada se levanta este monasterio, fundado por un grupo de benedictinos que poco despu&eacute;s del descubrimiento de los restos del Ap&oacute;stol se establecieron en el lugar llamado Pignario, pr&oacute;ximo a la capilla de la Corticela (hoy integrada dentro de la Catedral), donde celebraban sus oficios. El mayor desarrollo comienza cuando en 1494 pasa a depender de la congregaci&oacute;n benedictina de Valladolid. A partir de aqu&iacute; alcanzar&aacute;n la riqueza que les va a permitir sufragar las imponentes obras de la iglesia, que constituye, junto a la Catedral, el m&aacute;s valioso conjunto del barroco gallego. Durante 1991, tras ser acondicionadas las dependencias mon&aacute;sticas y limpiados y restaurados los valiosos retablos, acogi&oacute; la exposici&oacute;n antol&oacute;gica del arte gallego ''Galicia no tempo''. En el a&ntilde;o 2000, en el que Santiago celebr&oacute; la capitalidad cultural, acogi&oacute; la exposici&oacute;n ''As Faces de Deus''. <br /><br /><strong>IGLESIA</strong><br />Los arquitectos que trabajaron en la iglesia fueron el portugu&eacute;s Mateo L&oacute;pez, que se encarg&oacute; de las primeras trazas; el granadino Bartolom&eacute; Fern&aacute;ndez Lechuga, que construye la magn&iacute;fica c&uacute;pula nervada y organiza el espacio interior consiguiendo una gran majestuosidad; el salmantino Pe&ntilde;a y Toro, que se encarga de las obras de contenci&oacute;n pues hab&iacute;an cedido los muros, y finalmente, fray Tom&aacute;s Alonso y fray Gabriel Casas, con distintas aportaciones en la fachada del monasterio, claustros, campanario y dependencias monacales. Sobre la puerta se despliega una vistosa fachada plateresca. Presiden en la parte central, entre la puerta y el &oacute;culo, la Virgen, San Bieito y San Bernardo, mientras que en el front&oacute;n que corona la portada est&aacute; San Marti&ntilde;o repartiendo su capa con un pobre. Las torres se levantan s&oacute;lo hasta la altura de la fachada, debido a la oposici&oacute;n del cabildo catedralicio, temeroso de que la bas&iacute;lica perdiese visibilidad. Para vencer el desnivel del terreno, el benedictino Pl&aacute;cido Cami&ntilde;a construy&oacute; la hermosa escalera de acceso a la puerta, sin duda inspirada en la que da acceso a la Catedral desde la fachada del Obradoiro. El templo posee planta de cruz latina con tres naves en el brazo principal y una en el transversal, recorridas por una tribuna. Se emplea la b&oacute;veda de ca&ntilde;&oacute;n en la que se enmascaran los nervios a modo de falsos casetones. Varias capillas comunicadas entre s&iacute;, se abren a cada lado del brazo longitudinal. En el interior llama poderosamente la atenci&oacute;n el fastuoso retablo mayor de estilo barroco dise&ntilde;ado por F. de Casas y Novoa y ejecutado por Romay. Cerrando los frontispicios del crucero encontramos el Retablo de San Bieito en el norte y el Retablo de la Virgen Inglesa en el sur. Adem&aacute;s de los anteriores, tambi&eacute;n podemos contemplar el Retablo de la capilla del Socorro, el de Santa Escol&aacute;stica, el del Cristo de la Paciencia y el de Santa Xertrude. Es preciso destacar as&iacute; mismo, la siller&iacute;a del coro, realizada en nogal por Mateo de Prado, y que es reconocida como la m&aacute;s importante de las realizadas en Galicia y una de las principales a nivel peninsular.<br /><br /><strong>MONASTERIO</strong><br />El monasterio es de gran sencillez y frialdad de l&iacute;neas, s&oacute;lo interrumpidas por la fachada, a la que se accede por una gran escalinata. La fachada se divide en tres partes con un eje central flanqueado por dos grandes lienzos de cuatro pisos. La torre de cinco cuerpos contribuye a romper la monoton&iacute;a de la fachada. La portada enmarcada por severas columnas d&oacute;ricas, acoge a San Bieito, rematando con la estructura a&ntilde;adida por Fernando de Casas en la que est&aacute; el escudo de Espa&ntilde;a entre vieiras y la figura de San Marti&ntilde;o de Tours. Dentro del monasterio se encuentran el claustro de las oficinas, el m&aacute;s primitivo y el claustro procesional.</p> <p><strong>&nbsp;</strong></p>', '<p>En la Plaza de la Inmaculada se levanta este monasterio, fundado por un grupo de benedictinos que poco despu&eacute;s del descubrimiento de los restos del Ap&oacute;stol se establecieron en el lugar llamado Pignario, pr&oacute;ximo a la capilla de la Corticela (hoy integrada dentro de la Catedral), donde celebraban sus oficios. El mayor desarrollo comienza cuando en 1494 pasa a depender de la congregaci&oacute;n benedictina de Valladolid. A partir de aqu&iacute; alcanzar&aacute;n la riqueza que les va a permitir sufragar las imponentes obras de la iglesia, que constituye, junto a la Catedral, el m&aacute;s valioso conjunto del barroco gallego.</p>', 'España', 'Santiago de Compostela', 'Praza da Inmaculada 3', 'http://www.santiagoturismo.com/monumentos/mosteiro-e-igrexa-de-san-martino-pinario', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000002C0DDB9A9D1621C069DC1F18D5704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (9, 'Monasterio e Iglesia de San Paio de Antealtares', 15704, '<p>Ss. IX-XVIII. Actualmente Barroco. <br /><br />Fue fundado en el siglo IX por Alfonso II con doce monjes benedictinos, para que cuidaran y dieran culto al recientemente aparecido sepulcro del Ap&oacute;stol Santiago. La actual construcci&oacute;n pertenece casi en su totalidad a los siglos XVII y XVIII, ya que la primitiva fue derrumbada. <br /><br />Uno de los muros laterales cierra un flanco de la Plaza de la Quintana con absoluta sobriedad, a base de muros lisos sin decoraci&oacute;n. En el centro de este muro, una l&aacute;pida recuerda la formaci&oacute;n del Batall&oacute;n Literario organizado por los universitarios compostelanos para defensa de Galicia contra las Tropas de Napole&oacute;n. <br /><br />En la fachada opuesta a la Plaza de la Quintana, encontramos la porter&iacute;a y en el &aacute;ngulo la llamada puerta de los carros. <br /><br />Tras la marcha de los monjes benedictinos en 1499, el monasterio fue ocupado por monjas de clausura. El convento se dedic&oacute; a San Paio, que siendo ni&ntilde;o fuera martirizado en C&oacute;rdoba. Su imagen degollada preside la fachada del templo. <br /><br />La iglesia, de planta de cruz griega fue dise&ntilde;ada por frei Gabriel de Casas. Destaca en su interior el retablo del altar mayor. <br /><br />A trav&eacute;s de la iglesia podemos acceder al Museo de Arte Sacra, en el que se conserva el primitivo altar que acompa&ntilde;aba al sarc&oacute;fago apost&oacute;lico y que fue regalado por Xelm&iacute;rez a este convento, substituy&eacute;ndolo por otro m&aacute;s grandioso en el interior de la catedral.</p>', '<p>Ss. IX-XVIII. Actualmente Barroco.&nbsp;Fue fundado en el siglo IX por Alfonso II con doce monjes benedictinos, para que cuidaran y dieran culto al recientemente aparecido sepulcro del Ap&oacute;stol Santiago. La actual construcci&oacute;n pertenece casi en su totalidad a los siglos XVII y XVIII, ya que la primitiva fue derrumbada.&nbsp;</p>', 'España', 'Santiago de Compostela', 'Praza da Quintana de Vivos', 'http://www.santiagoturismo.com/monumentos/mosteiro-e-igrexa-de-san-paio-de-antealtares-11', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E610000018BFBE10511621C010BDF7FDBC704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (10, 'Convento de Santa Clara', 15704, '<p>S. XVII. Barroco. <br /><br />Su origen conventual se remonta al siglo XIII, aunque su factura actual es fruto de la reconstrucci&oacute;n barroca, finalizada en el siglo XVII por Pedro Ar&eacute;n. <br /><br />Cuenta con una peculiar fachada-tel&oacute;n, claro ejemplo del barroco compostelano, trazada por Sim&oacute;n Rodr&iacute;guez en el siglo XVIII.&nbsp; Al fondo de un peque&ntilde;o jard&iacute;n, se esconde la verdadera fachada, m&aacute;s sencilla, que da acceso al templo. <br /><br />En su interior se conservan un retablo de Domingo de Andrade de 1700 y varios altares churriguerescos. <br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa de San Roque', 'http://www.santiagoturismo.com/monumentos/convento-de-santa-clara', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E610000073A2B83E071521C00BF22F5947714540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (11, 'Colegiata Santa María a Real do Sar', 15702, '<p>S. XII. Rom&aacute;nica.<br /><br />Construida en el siglo XII a las orillas del r&iacute;o Sar es, junto con la Catedral, la iglesia que conserva mayor parte de su primitiva f&aacute;brica rom&aacute;nica. <br /><br />En el exterior llaman la atenci&oacute;n los robustos arbotantes construidos entre los siglos XVII y XVIII para proteger los muros septentrionales y evitar su derrumbe: bien fuese por un error t&eacute;cnico en la construcci&oacute;n, por la atrevida elevaci&oacute;n de las naves laterales, por el corrimiento del inestable terreno sobre el que se asienta, que a menudo es inundado por el r&iacute;o, o por voluntad de quienes trabajaron en su construcci&oacute;n, los muros y las columnas interiores est&aacute;n visiblemente inclinados, lo que le confiere un singular atractivo y oblig&oacute; a rehacer la b&oacute;veda de ca&ntilde;&oacute;n en el siglo XVI. <br /><br />El interior, de hermosas proporciones, impresiona a todo aquel que lo visita por la inclinaci&oacute;n de las columnas hacia las naves laterales, dando sensaci&oacute;n de inestabilidad. La pila bautismal, a la derecha de la puerta principal, es una interesante pieza arqueol&oacute;gica del siglo XII. <br /><br />A trav&eacute;s de la sacrist&iacute;a puede accederse al claustro, el &uacute;nico que posee la ciudad en estilo rom&aacute;nico. S&oacute;lo se conserva una de las alas, el resto pertenece a los siglos XVII y XVIII. Dentro se expone una <a href="http://www.santiagoturismo.com/museos/museo-da-colexiata-do-sar" target="_blank">buena colecci&oacute;n de piezas arqueol&oacute;gicas y lit&uacute;rgicas</a>.<br /><br /></p>', '<p>S. XII. Rom&aacute;nica.&nbsp;Construida en el siglo XII a las orillas del r&iacute;o Sar es, junto con la Catedral, la iglesia que conserva mayor parte de su primitiva f&aacute;brica rom&aacute;nica.&nbsp;</p>', 'España', 'Santiago de Compostela', 'Rúa de Sar', 'http://www.santiagoturismo.com/monumentos/colexiata-santa-maria-a-real-do-sar-6', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E610000083E36C19F41221C0D018DE93A46F4540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (12, 'Colegio de Fonseca', 15702, '<p>S. XVI. Renacentista.<br /><br />Este colegio fue mandado construir por el arzobispo Alonso de Fonseca adaptando la casa donde &eacute;l hab&iacute;a nacido y que pertenec&iacute;a a su influyente familia, para ejercer la funci&oacute;n pedag&oacute;gica. Comenz&oacute; a funcionar en el a&ntilde;o 1544 y en &eacute;l tendr&aacute; sede la Universidad Compostelana creada con el patrocinio de su familia a principios de siglo. La fachada es de estilo renacentista. Consta de dos cuerpos con estatuas g&oacute;ticas en los intercolumnios y en los nichos del friso. En el centro de la fachada, en el medio del friso que separa los dos cuerpos con los que cuenta el edificio, destaca el escudo con las cinco estrellas de los Fonseca, rodeado de las im&aacute;genes que representan a los Doctores de la Iglesia. En el interior podemos visitar el patio circundado por una leyenda epigr&aacute;fica, obra de Gil de Honta&ntilde;&oacute;n. A la derecha de la puerta est&aacute; la entrada a la capilla g&oacute;tica y a la izquierda la entrada al Sal&oacute;n Artesonado. En la actualidad acoge la Biblioteca Xeral da Universidade.</p>', '<p>S. XVI. Renacentista. Este colegio fue mandado construir por el arzobispo Alonso de Fonseca adaptando la casa donde &eacute;l hab&iacute;a nacido y que pertenec&iacute;a a su influyente familia, para ejercer la funci&oacute;n pedag&oacute;gica. Comenz&oacute; a funcionar en el a&ntilde;o 1544 y en &eacute;l tendr&aacute; sede la Universidad Compostelana creada con el patrocinio de su familia a principios de siglo.&nbsp;</p>', 'España', 'Santiago de Compostela', 'Rúa do Franco 3', 'http://www.santiagoturismo.com/monumentos/colexio-de-fonseca-3', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000F17C8A0C401721C045E01F2190704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (15, 'Iglesia y Convento de San Domingos de Bonaval', 15703, '<p>IGLESIA: S. XIV. G&oacute;tico con reminiscencias rom&aacute;nicas. <br /><br />La iglesia fue construida en el siglo XIV siguiendo los c&aacute;nones de la arquitectura mendicante. Consta de tres naves separadas por arcos de medio punto y una estilizada capilla mayor con altas ventanas y b&oacute;veda de crucer&iacute;a. A trav&eacute;s del convento se accede a su interior, en el que destacan los cuatro sepulcros g&oacute;ticos situados a ambos lados del altar, las V&iacute;rgenes con el Ni&ntilde;o del siglo XV y la capilla del Rosario, que contiene retablos barrocos elaborados por Pedro Taboada y Francisco Castro Canseco. Es de gran inter&eacute;s el Pante&oacute;n de Galicia, situado en una capilla lateral de la iglesia, donde reposan, entre otros, Rosal&iacute;a de Castro, Castelao, Alfredo Bra&ntilde;as, Ram&oacute;n Cabanillas y Francisco Asorey. Por este motivo este templo es un lugar asociado a la memoria galleguista. El claustro alberga un interesante crucero g&oacute;tico. En la actualidad se utiliza como lugar de exposiciones y conciertos. <br /><br />CONVENTO: S. XIII. Diferentes estilos. <br /><br />Fundado seg&uacute;n la tradici&oacute;n en 1220 por Santo Domingo de Guzm&aacute;n, el edificio actual data del siglo XIV en sus partes m&aacute;s antiguas, con reformas y ampliaciones realizadas en el siglo XVII por Domingo de Andrade, que deja su huella barroca en el convento. En 1912 fue declarado Monumento Nacional. Sus dependencias albergan el Museo do Pobo Galego, en donde se conserva la memoria etnogr&aacute;fica de Galicia. A las distintas salas -dedicadas al mar, la agricultura, los oficios artesanales o el traje gallego- se accede a trav&eacute;s de la sorprendente triple escalera de caracol de Domingo de Andrade, obra emblem&aacute;tica del barroco compostelano. Cada una de sus tres rampas conduce, independientes unas de otras, a cada uno de los pisos del convento.</p>', ' ', 'España', 'Santiago de Compostela', 'Costa de San Domingos', 'http://www.santiagoturismo.com/monumentos/igrexa-e-convento-de-san-domingos-de-bonaval', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000FD084F2A121421C0D2B2A492F0704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (16, 'Convento e Iglesia de Santo Agostiño', 15704, '<p>S. XVII. Barroco <br /><br />Situado en la plaza del mismo nombre, el convento de San Agust&iacute;n se construy&oacute; a mediados del siglo XVII, con una donaci&oacute;n del Conde de Altamira, para la Orden de los Agustinos Calzados. La iglesia y el claustro son obra de Fern&aacute;ndez Lechuga. En la fachada de estilo neocl&aacute;sico se halla una imagen de la Virgen de la Cerca, as&iacute; llamada por haber estado colocada en un nicho de la antigua muralla. El proyecto inicial contaba con dos torres: la de la derecha nunca fue terminada y la de la izquierda fue destruida por un rayo en 1788. El convento fue abandonado en la &eacute;poca de la exclaustraci&oacute;n, dedic&aacute;ndose a diversos usos. En la actualidad est&aacute; ocupado por los jesuitas y funciona como colegio mayor universitario.<br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa de Santo Agostiño 2', 'http://www.santiagoturismo.com/monumentos/convento-e-igrexa-de-santo-agostino', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000003E4FB0BD1E1521C03035F8B1B8704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (17, 'Pazo de Bendaña', 0, '<p>Mediados s. XVIII. Barroco.<br /><br />Palacio urbano obra de Clemente Fern&aacute;ndez Sarela y mandado construir por los marqueses de Benda&ntilde;a. Fue terminado en 1759. Destaca por los art&iacute;sticos balcones con enrejados del barroco compostelano y por la estatua de un Atlas o H&eacute;rcules sosteniendo el globo del mundo que corona la fachada sobre el escudo de los marqueses. Son tambi&eacute;n peculiares la robusta chimenea y la espaciosa escalera central. En el siglo XIX los originales tragaluces del cuerpo inferior se convirtieron en puertas, cambiando el aspecto de la fachada. En la actualidad alberga la <a href="http://www.santiagoturismo.com/museos/museo-fundacion-eugenio-granell" target="_blank">Fundaci&oacute;n y Museo Eugenio Granell </a>dedicado a actividades culturales y exposiciones.</p>', '<p>Mediados s. XVIII. Barroco. Palacio urbano obra de Clemente Fern&aacute;ndez Sarela y mandado construir por los marqueses de Benda&ntilde;a. Fue terminado en 1759. Destaca por los art&iacute;sticos balcones con enrejados del barroco compostelano y por la estatua de un Atlas o H&eacute;rcules sosteniendo el globo del mundo que corona la fachada sobre el escudo de los marqueses.</p>', ' ', ' ', 'Praza do Toural, s/n', 'http://www.santiagoturismo.com/monumentos/pazo-de-bendana-1', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000A1116C5CFF1621C09835B1C057704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (18, 'Colegio San Clemente de Pasantes', 15705, '<p>Se fund&oacute; en 1610 por el arzobispo Juan de Sanclemente y Torquemada para ense&ntilde;ar teolog&iacute;a, y fue denominado San Clemente de Pasantes porque en &eacute;l se admit&iacute;an &uacute;nicamente doctores, es decir, personas que ya hubiesen terminado la carrera.<br /><br />Es actual sede del Instituto de Bachillerato ''Rosal&iacute;a de Castro'', aunque desde su fundaci&oacute;n ha albergado numerosas instituciones p&uacute;blicas y privadas tales como la Real Sociedad Econ&oacute;mica de Amigos del Pa&iacute;s, el Museo Arqueol&oacute;gico, la facultad de Derecho, etc. Tiene planta cuadrangular, en siller&iacute;a de granito, con dos alturas y dispuesta en torno a un patio central cl&aacute;sico, acorde con su destino universitario. En la fachada hay elementos decorativos innovadores en el barroco gallego de inicios del siglo XVII. <br /><br /></p>', '<p>Se fund&oacute; en 1610 por el arzobispo Juan de Sanclemente y Torquemada para ense&ntilde;ar teolog&iacute;a, y fue denominado San Clemente de Pasantes porque en &eacute;l se admit&iacute;an &uacute;nicamente doctores, es decir, personas que ya hubiesen terminado la carrera.</p>', 'España', 'Santiago de Compostela', 'Avenida de Figueroa', 'http://www.santiagoturismo.com/monumentos/colexio-san-clemente-de-pasantes-2', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000004BA26661B21721C0E31934F44F704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (19, 'Casa da Parra', 15704, '<p>Finales s. XVII. Barroca.<br /><br />Obra de Domingo de Andrade, fue objeto de reformas en el siglo XX, en el que se le a&ntilde;adi&oacute; la balaustrada superior y un piso m&aacute;s. Destaca la decoraci&oacute;n a base de racimos que enmarcan las puertas inferior y superior del lado derecho, as&iacute; como las m&eacute;nsulas labradas en la parte inferior del balc&oacute;n y la monumental chimenea.&nbsp;</p>', '<p>Finales s. XVII. Barroco. Obra de Domingo de Andrade, fue objeto de reformas en el siglo XX, en el que se le a&ntilde;adi&oacute; la balaustrada superior y un piso m&aacute;s. Destaca la decoraci&oacute;n a base de racimos que enmarcan las puertas inferior y superior del lado derecho, as&iacute; como las m&eacute;nsulas labradas en la parte inferior del balc&oacute;n y la monumental chimenea.</p>', 'España', 'Santiago de Compostela', 'Praza da Quintana de Vivos 1', 'http://www.santiagoturismo.com/monumentos/casa-da-parra-1', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000EF95713A661621C003FB3B1DC0704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (20, 'Facultad de Geografía e Historia', 15704, '<p>S. XVIII. Neocl&aacute;sica.</p> <p>Este edificio neocl&aacute;sico de enormes columnas fue levantado con planos de Melchor de Prado entre 1769 y 1805, en el solar que hab&iacute;a ocupado el colegio de la Compa&ntilde;&iacute;a de Jes&uacute;s. El &uacute;ltimo piso se a&ntilde;adi&oacute; a finales del s. XIX. El frontis que representaba a Minerva fue sustituido entonces por las estatuas gigantes de los benefactores de la Universidad: Lope G&oacute;mez de Marzoa, Juan de Ulloa, &Aacute;lvaro de Cadaval y el conde de Monterrey.</p> <p>En su interior destacan el claustro ajardinado con fuente, el paraninfo con frescos de Fenolera y Gonz&aacute;lez, y la sala de lectura, as&iacute; como las terrazas con vistas a toda la ciudad.</p>', '<p>S. XVIII. Neocl&aacute;sica. Este edificio neocl&aacute;sico de enormes columnas fue levantado con planos de Melchor de Prado entre 1769 y 1805, en el solar que hab&iacute;a ocupado el colegio de la Compa&ntilde;&iacute;a de Jes&uacute;s. El &uacute;ltimo piso se a&ntilde;adi&oacute; a finales del s. XIX. El frontis que representaba a Minerva fue sustituido entonces por las estatuas gigantes de los benefactores de la Universidad: Lope G&oacute;mez de Marzoa, Juan de Ulloa, &Aacute;lvaro de Cadaval y el conde de Monterrey.</p> <p>&nbsp;</p>', 'España', 'Santiago de Compostela', 'Travesía da Universidade 1', 'http://www.santiagoturismo.com/monumentos/facultade-de-xeografia-e-historia', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000BD1C13B5761521C0F081E3537C704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (22, 'Monasterio e Iglesia de Santa María de Conxo', 15706, '<p>Iglesia: s. XVII. Barroca. Claustro rom&aacute;nico.<br /><br />En el centro del barrio de Conxo est&aacute; el Monasterio de Santa Mar&iacute;a. Seg&uacute;n la tradici&oacute;n, fue fundado por la se&ntilde;ora Rusuida para dar digna sepultura a su marido, asesinado cuando hacia el Camino de Santiago. En cualquier caso, los documentos hist&oacute;ricos atribuyen la fundaci&oacute;n al arzobispo Xelm&iacute;rez con el fin de albergar una comunidad de monjas.</p> <p>El claustro rom&aacute;nico de la &eacute;poca de su fundaci&oacute;n en el siglo XII, conserva dos de sus alas en las que se puede leer la inscripci&oacute;n fundacional del a&ntilde;o 1129. Las monjas que lo habitaban pasaron al Monasterio de Antealtares en el siglo XV. Posteriormente fue habitado por frailes mercedarios.En el siglo XIX, tras el traslado de esta congregaci&oacute;n a Poio,&nbsp;acogi&oacute; el Sanatorio Psiqui&aacute;trico Provincial. Desde 1993, es Hospital Psiqui&aacute;trico perteneciente al sistema sanitario p&uacute;blico. El claustro rom&aacute;nico puede visitarse solicitando permiso en la recepci&oacute;n del Sanatorio.</p> <p>La iglesia actual obra de Gonz&aacute;lez de Ara&uacute;jo data del siglo XVII. En su interior conserva un retablo barroco con im&aacute;genes de gran valor, entre las que destaca el Cristo crucificado de Gregorio Fern&aacute;ndez, una imagen muy realista. Del siglo XVIII es la porter&iacute;a que se debe a Clemente Fern&aacute;ndez Sarela.</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa do Campo de Conxo', 'http://www.santiagoturismo.com/monumentos/mosteiro-e-igrexa-de-santa-maria-de-conxo', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000000E6D3AE1A91C21C09194575B6F6E4540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (23, 'Iglesia de la Tercera Orden', 15705, '<p>S. XVIII. Barroco. <br /><br />En &aacute;ngulo con la portada del templo de San Francisco, Domingo de Andrade edific&oacute; la capilla de la Venerable Orden Tercera. Su retablo fue trazado por Miguel de Romai en 1714. <br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa do Campiño de San Francisco 2', 'http://www.santiagoturismo.com/monumentos/igrexa-da-terceira-orde', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000001F592BA0711721C002B57B6607714540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (24, 'Pazo de Santa Cruz', 15702, '<p>Principios s. XIX. <br /><br />Se trata de un edificio de tres plantas, obra del arquitecto Fernando Dom&iacute;nguez y Romay. La planta baja destaca por la austera decoraci&oacute;n basada en un ligero almohadillado. En el primer piso destacan los balcones de hierro enroscado. Sobre la cornisa lleva un front&oacute;n triangular bajo el que se sit&uacute;a el escudo del Marqu&eacute;s de Santa Cruz.</p>', ' ', ' ', 'Santiago de Compostela', 'Rúa Nova, 9', 'http://www.santiagoturismo.com/monumentos/pazo-de-santa-cruz', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000007BBFD18E1B1621C0587380608E704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (25, 'Convento, Iglesia y Colegio de las Huérfanas', 15703, '<p>S. XVII. Barroco.<br /><br />En la r&uacute;a das Orfas, se hallan la iglesia y el colegio del mismo nombre. El Arzobispo Juan de Sanclemente fund&oacute; este edificio a finales del siglo XVI para dar alojamiento y educaci&oacute;n a ni&ntilde;as hu&eacute;rfanas o de pocos recursos. M&aacute;s tarde fue modificado por Domingo de Andrade y Fernando de Casas y N&oacute;voa. La iglesia fue construida por Melchor Velasco en 1671. En el retablo del altar mayor, obra de Francisco de Lens, sobresale una Inmaculada de Gambino, entre San Jos&eacute; y Santiago. En la actualidad es sede del colegio Nuestra Se&ntilde;ora de los Remedios.<br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa das Orfas 5', 'http://www.santiagoturismo.com/monumentos/convento-igrexa-e-colexio-das-orfas-3', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000B3BE584A5C1621C01DD712345E704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (26, 'Iglesia de la Compañía o de la Universidad', 15703, '<p>S. XVII. Barroco.<br /><br />Junto a la Facultad de Geograf&iacute;a e Historia se levanta la Iglesia de la Compa&ntilde;&iacute;a. Fue construida por los jesuitas en el siglo XVII. A finales del siglo XVIII, cuando la <script src="/js/tiny_mce/themes/advanced/langs/en.js" type="text/javascript"></script> orden fue expulsada de Espa&ntilde;a, pas&oacute; a ser capilla de la Universidad y las im&aacute;genes de la fachada que representaban a San Ignacio y a San Francisco Javier fueron modificadas para representar a San Pedro y a San Pablo. Tiene un valioso retablo mayor barroco en su interior.</p> <p>Hoy el edificio se usa activamente como sala de exposiciones y sede de la Orquesta de la Universidade de Santiago de Compostela.</p>', '<p>S. XVII. Barroco.&nbsp;Fue construida por los jesuitas en el siglo XVII.&nbsp;Tiene valiosos retablos barrocos en su interior, entre los que destaca el retablo mayor, de Sim&oacute;n Rodr&iacute;guez.&nbsp;</p>', 'España', 'Santiago de Compostela', 'Praza da Universidade', 'http://www.santiagoturismo.com/monumentos/igrexa-da-compania-ou-da-universidade', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000C1892AF4A81521C08FD3A5B974704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (28, 'Convento de Belvís', 15703, '<p>S. XIV. Barroco.<br /><br />Fundado en el siglo XIV por Teresa Gonz&aacute;lez, fue reedificado en &eacute;poca barroca por el arzobispo mejicano Monroy, de la orden de los dominicos. <br /><br />Se encuentra algo alejado del conjunto hist&oacute;rico, pero se puede llegar a &eacute;l caminando por la singular R&uacute;a das Trompas. <br /><br />La iglesia es obra de Fernando de Casas y Novoa. Lo m&aacute;s destacado es la fachada del comulgatorio en la que Fernando de Casas utiliza su caracter&iacute;stica decoraci&oacute;n geom&eacute;trico-vegetal. <br /><br />En el templo se venera a la Virgen del Portal, la figura cuyo hallazgo motiv&oacute; la fundaci&oacute;n del convento en 1313. La leyenda le atribuye el milagro de ''huir'' de su capilla y aparecer en el peque&ntilde;o nicho de la porter&iacute;a donde estuvo originalmente colocada.<br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa de Belvís 2', 'http://www.santiagoturismo.com/monumentos/114', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000009F42E87F3D1321C0D69BC54969704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (29, 'Iglesia del Pilar', 15701, '<p>S. XVIII. Barroca. <br /><br />Enclavada en el parque m&aacute;s emblem&aacute;tico de Santiago, la Alameda, al lado del paseo en forma de U conocido como Paseo da Ferradura, se levanta este templo de estilo barroco. Consta de planta de cruz latina con crucero y presbiterio. <br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Avenida de Xoán Carlos I', 'http://www.santiagoturismo.com/monumentos/igrexa-do-pilar-1', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000E451437EAA1821C023C53A3430704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (30, 'Convento del Colegio de la Compañía de María o de la Enseñanza', 15703, '<p>S. XVIII. Barroco.<br /><br />Fue fundado por el Arzobispo Raxoi en 1765 como colegio de se&ntilde;oritas nobles. Su construcci&oacute;n fue finalizada en el a&ntilde;o 1821 por el arzobispo M&uacute;zquiz, cuyo escudo de armas aparece en el front&oacute;n de la fachada neocl&aacute;sica del convento. La iglesia es de planta de cruz griega. Hoy es colegio y residencia de la Compa&ntilde;&iacute;a de Mar&iacute;a. <br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa da Ensinanza 3', 'http://www.santiagoturismo.com/monumentos/convento-do-colexio-da-compania-de-maria-ou-da-ensinanza', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000C26856B60F1521C09EB12FD978704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (31, 'Iglesia de San Miguel dos Agros', 15704, '<p>S. XVIII. Neocl&aacute;sico. <br /><br /><br />De espaldas a San Marti&ntilde;o Pinario, en la Plaza de San Miguel, se levanta una iglesia del siglo XVIII sin m&eacute;rito art&iacute;stico especial. La fachada se debe a Melchor de Prado Mari&ntilde;o. Cuatro pilastras j&oacute;nicas acanaladas en un gran &oacute;culo central animan esta desnuda obra arquitect&oacute;nica.</p>', ' ', 'España', 'Santiago de Compostela', 'Praza de San Miguel dos Agros', 'http://www.santiagoturismo.com/monumentos/igrexa-de-san-miguel-dos-agros-3', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E610000040A096930E1621C0D06032D9E8704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (32, 'Pazo de Feixoo', 15704, '<p>Principios S. XVIII. Barroco.<br /><br />Palacio obra de Domingo de Andrade, en el que el autor resume su ideal sobre la construcci&oacute;n de un palacio urbano. La obra fue encargada por el can&oacute;nigo Don Juan Antonio Somoza. Destacan el amplio vest&iacute;bulo y la impresionante escalera.</p>', ' ', 'España', 'Santiago de Compostela', 'Praza de Feixóo 1', 'http://www.santiagoturismo.com/monumentos/pazo-de-feixoo', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000FF14D8ADAF1521C08ED22147A5704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (33, 'Colegio de San Xerome', 15704, '<p>S. XVII.</p> <p>El Colegio de San Xerome era el llamado Estudio Viejo, establecido por el arzobispo Fonseca III para estudiantes pobres, cerca del <a href="http://www.santiagoturismo.com/monumentos/mosteiro-e-igrexa-de-san-martino-pinario">Convento de San Marti&ntilde;o</a>. Cuando los monjes de San Marti&ntilde;o Pinario lo compraron para ampliar el convento, se levant&oacute; este nuevo edificio en la Praza do Obradoiro. En su entrada se instal&oacute; la portada rom&aacute;nico-g&oacute;tica del antiguo colegio. En el centro de la arquivolta figura la Virgen con el Ni&ntilde;o rodeada de numerosos santos. El t&iacute;mpano est&aacute; presidido por la Inmaculada. Sobre la portada encontramos el escudo del fundador, el arzobispo Fonseca. En el interior, que en la actualidad alberga el Rectorado de la Universidad, hay un patio clasicista que hoy vemos acristalado.</p>', '<p>S. XVII. El Colegio de San Xerome era el llamado Estudio Viejo, establecido por el arzobispo Fonseca III para estudiantes pobres, cerca del <a href="http://www.santiagoturismo.com/monumentos/mosteiro-e-igrexa-de-san-martino-pinario">Convento de San Marti&ntilde;o</a>. Cuando los monjes de San Marti&ntilde;o Pinario lo compraron para ampliar el convento, se levant&oacute; este nuevo edificio en la Praza do Obradoiro.</p> <p>&nbsp;</p>', 'España', 'Santiago de Compostela', 'Praza do Obradoiro', 'http://www.santiagoturismo.com/monumentos/colexio-de-san-xerome', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000DA5991244A1721C0A3D1998BAA704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (34, 'Pazo de Amarante', 15704, '<p>S. XVIII. Barroco.<br /><br />Se trata de una edificaci&oacute;n civil del s.XVIII, dise&ntilde;ada siguiendo las pautas del estilo barroco. Destaca el escudo de los Amarante-Camarasa, que podemos ver en la fachada. Acogi&oacute; hace a&ntilde;os los antiguos juzgados.</p> <p>El pazo cuenta con un jard&iacute;n de 800 metros cuadrados y con una zona de acceso de 525 metros cuadrados, y en &eacute;l se conservan distintas especies de &aacute;rboles de porte muy antiguo.</p>', '<p>S. XVIII. Barroco. Se trata de una edificaci&oacute;n civil, dise&ntilde;ada siguiendo las pautas del estilo barroco. Destaca el escudo de los Amarante-Camarasa, que podemos ver en la fachada. Acogi&oacute; hace a&ntilde;os los antiguos juzgados.</p>', 'España', 'Santiago de Compostela', 'Rúa da Algalia de Abaixo 26', 'http://www.santiagoturismo.com/monumentos/pazo-de-amarante', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000029EB470591521C0FF942A51F6704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (36, 'Iglesia de San Pedro', 15703, '<p>S. XVIII. Neocl&aacute;sico. <br /><br />Bajando por la r&uacute;a de San Pedro, siguiendo en sentido contrario el camino que conduce a los peregrinos del Camino Franc&eacute;s hacia Porta do Cami&ntilde;o, nos encontramos esta iglesia de estilo neocl&aacute;sico. Conserva algunos restos de la primitiva construcci&oacute;n del antiguo monasterio de San Pedro de F&oacute;ra, del siglo XII, sobre el que se levant&oacute; la nueva f&aacute;brica. <br /><br />En su atrio se descubrieron restos de enterramientos, muy probablemente de monjes y peregrinos de los siglos XII a XV enterrados en el antiguo monasterio benedictino, que prest&oacute; servicio de hospeder&iacute;a a los devotos del Ap&oacute;stol mucho antes de que se construyera el Hostal de los Reyes Cat&oacute;licos en el siglo XVI. <br /><br />En el interior del templo destacan las tallas de Ferreiro. <br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Calzada de San Pedro', 'http://www.santiagoturismo.com/monumentos/igrexa-de-san-pedro', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E610000049F29EFB591321C0DB13C9FCC8704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (37, 'Iglesia de Santa María do Camiño', 15704, '<p>S.XVIII. Neocl&aacute;sico.</p> <p>Este templo, situado en la confluencia de las r&uacute;as Travesa y Oliveira, fue reconstruido sustituyendo al primitivo de &eacute;poca rom&aacute;nica. Miguel Ferro Caaveiro remat&oacute; las obras alrededor de 1770. Destacan la imagen neocl&aacute;sica de la Inmaculada de Manuel Prado Mari&ntilde;o, de canon muy esbelto, que aparece pisando la serpiente; un retablo mayor de Manuel de Leis e im&aacute;genes rococ&oacute; de Bieito Silveira. <br /><br /><br /><br /><br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa Travesa 20', 'http://www.santiagoturismo.com/monumentos/igrexa-de-santa-maria-do-camino', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000001D27E032021521C01A47D544D9704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (38, 'Pazo de Fondevila', 15704, '<p>Mediados s. XVIII.&nbsp; Barroco.<br /><br />Trazado por Clemente Fern&aacute;ndez Sarela, responde a la arquitectura palaciega t&iacute;pica del barroco compostelano. La decoraci&oacute;n se centra en la esquina en chafl&aacute;n del edificio, en la que podemos apreciar bajo un front&oacute;n circular, un ostentoso escudo. Es tambi&eacute;n destacable el enmarcado de los ventanales y los balcones volados.</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa das Casas Reais, 12', 'http://www.santiagoturismo.com/monumentos/pazo-de-fondevila', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E610000011C80480531521C0B1DE66F9D3704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (39, 'Pazo de Raxoi', 15705, '<p>S. XVIII. <br /><br />Cerrando la Praza do Obradoiro y situado frente a la fachada oeste de la Catedral, se levanta este palacio, mandado construir por el arzobispo Raxoi en 1766, para residencia de los ni&ntilde;os del coro y seminario. Las obras fueron ejecutadas por el ingeniero franc&eacute;s Charles Lemaur. La larga fachada abierta con un elegante soportal, dota al edificio de una marcada horizontalidad. En el centro de la fachada puede verse un front&oacute;n con un relieve en m&aacute;rmol, en el que se representa la batalla de Clavijo, obra de Gambino y Ferreiro, coronado por la estatua ecuestre de Santiago. En el interior destaca la escalera rococ&oacute; dise&ntilde;ada tambi&eacute;n por Lemaur. En la actualidad es sede del Ayuntamiento compostelano, del Consello da Cultura Galega y de algunas dependencias del Gobierno de la Xunta de Galicia.</p>', '<p>S. XVIII.&nbsp;Cerrando la Praza do Obradoiro y situado frente a la fachada oeste de la Catedral, se levanta este palacio, mandado construir por el arzobispo Raxoi en 1766, para residencia de los ni&ntilde;os del coro y seminario. Las obras fueron ejecutadas por el ingeniero franc&eacute;s Charles Lemaur. La larga fachada abierta con un elegante soportal, dota al edificio de una marcada horizontalidad.</p>', 'España', 'Santiago de Compostela', 'Praza do Obradoiro', 'http://www.santiagoturismo.com/monumentos/pazo-de-raxoi', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000F3F9EE77A41721C0D0E769E1AE704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (41, 'Casa-pazo de Vaamonde', 0, '<p>S. XVIII. <br /><br />Edificio del siglo XVIII, formado por un bajo y dos plantas, que sobresale de la alineaci&oacute;n de las casas anteriores por medio de soportales. Destacan el escudo situado en la fachada del primer piso, el balc&oacute;n que se proyecta sobre la calle en el segundo, el llamador de la puerta- obra del escultor Francisco Asorey- y la vistosa cristalera de la puerta interior. Por el lado derecho delimita el callej&oacute;n de Entrerr&uacute;as, el m&aacute;s estrecho de Santiago y en el que apenas se pueden cruzar dos personas. En la actualidad es sede del Consorcio de Santiago.</p>', ' ', ' ', ' ', 'Rúa do Vilar, 59', 'http://www.santiagoturismo.com/monumentos/casa-pazo-de-vaamonde', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000004CE141B3EB1621C0F5F23B4D66704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (42, 'Casa-pazo de los Fonseca', 15705, '<p>Mediados s. XVI. Renacentista.<br /><br />De este palacio renacentista obra de Rodrigo Gil de Honta&ntilde;&oacute;n, s&oacute;lo se conserva el primer cuerpo formado por las cuatro arcadas de dicho estilo en la planta baja. Sobresalen sobre las uniones de los arcos los medallones que representan de izquierda a derecha a Pierres, Lucrecia y Paris. En los extremos tambi&eacute;n se conservan dos tritones sosteniendo unos escudos en los que se puede ver el blas&oacute;n de los Fonseca.</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa de Trás Salomé 3', 'http://www.santiagoturismo.com/monumentos/casa-pazo-dos-fonseca', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000009FD5D9FB1A1621C0D271D28770704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (44, 'Casa Gótica', 15704, '<p>S. XIV. G&oacute;tica.<br /><br />Este edificio tambi&eacute;n conocido como Casa do Rei Don Pedro, es una muestra de la arquitectura civil compostelana del siglo XIV. De la primitiva construcci&oacute;n conserva en la parte baja de la fachada principal la puerta de entrada y una ventana con arcos apuntados. En el primer piso, vemos otra ventana con tracer&iacute;a dentro de un arco apuntado decorado.</p>', '<p>S. XIV. G&oacute;tica. Este edificio tambi&eacute;n conocido como Casa do Rei Don Pedro, es una muestra de la arquitectura civil compostelana del siglo XIV.&nbsp;</p>', 'España', 'Santiago de Compostela', 'Rúa de San Miguel dos Agros 4', 'http://www.santiagoturismo.com/monumentos/139', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000A55A5540EB1521C0B8637F13E9704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (45, 'Iglesia de San Fructuoso', 15705, '<p>S. XVIII. Barroco. <br /><br />Conocido como iglesia de las Angustias de Abaixo, de la Real Angustia o sencillamente de San Fructuoso, este templo de estilo churrigueresco fue proyectado por Lucas Ferro Caaveiro en el siglo XVIII. En su construcci&oacute;n de planta central sobresale la grandiosa c&uacute;pula de media naranja. <br /><br />La fachada est&aacute; concebida para ser contemplada desde un plano superior, desde la Plaza del Obradoiro, por lo que la decoraci&oacute;n se concentra en la cornisa superior. All&iacute; se sit&uacute;an las im&aacute;genes de las cuatro virtudes cardinales, Prudencia, Justicia, Fortaleza y Templanza. La retranca popular pretende identificarlas con las cuatro sotas de la baraja espa&ntilde;ola. <br /><br />Completan la fachada un campanario adornado con volutas y pin&aacute;culos y una hornacina con la imagen de la Virgen de las Angustias. <br /><br />En el interior merece atenci&oacute;n la Piedad neocl&aacute;sica de Ant&oacute;n Fern&aacute;ndez o Vello que preside el altar mayor.<br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa da Trindade', 'http://www.santiagoturismo.com/monumentos/igrexa-de-san-fructuoso', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000F78B7ED9E21721C05F607736BB704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (47, 'Iglesia de Santa María Salomé', 15705, '<p>S. XII-XVIII. Barroco.<br /><br />Hacia la mitad de la r&uacute;a Nova se halla una de las muchas iglesias que mand&oacute; construir el arzobispo Xelm&iacute;rez en el siglo XII, &eacute;poca de la que &uacute;nicamente conserva la portada y algunos peque&ntilde;os detalles m&aacute;s. Es la &uacute;nica iglesia espa&ntilde;ola dedicada a la madre del Ap&oacute;stol Santiago y San Juan Evangelista. Sobre la clave de la triple arquivolta destaca una imagen sedente de la Virgen del siglo XIV y a ambos lados las estatuas de la Virgen -en estado de gestaci&oacute;n- y el &aacute;ngel de la Anunciaci&oacute;n, pertenecientes a un grupo escult&oacute;rico del siglo XV. La torre barroca, construida en el siglo XVIII , es claro ejemplo de la popularidad alcanzada por el modelo de campanario de la iglesia de San Fiz de Solovio. En el interior se encuentran algunas tallas barrocas de la escuela compostelana.<br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa Nova 31', 'http://www.santiagoturismo.com/monumentos/igrexa-de-santa-maria-salome-5', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000C2B1FC33621621C0FB873E6972704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (48, 'Iglesia de Santa Susana', 15705, '<p>S. XII. Rom&aacute;nico-g&oacute;tica. <br /><br />Localizada en la Alameda, en el pe&ntilde;asco que alberga la <em>carballeira </em>("robledal") del mismo nombre, se levanta esta iglesia, uno de los templos que consagr&oacute; el Arzobispo Xelm&iacute;rez en 1102, para acoger las reliquias de Santa Susana tra&iacute;das desde Portugal. El templo actual es una reconstrucci&oacute;n de los siglos XVII y XVIII, que conserv&oacute; como &uacute;nicas muestras de la primitiva obra rom&aacute;nica, la puerta principal, algunos modillones y la ventana con su tragaluz. Tambi&eacute;n se conserva la cruz g&oacute;tica sobre el &aacute;pice de la nave.<br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa do Campiño da Ferradura ', 'http://www.santiagoturismo.com/monumentos/igrexa-de-santa-susana', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000BFF328E8381921C0E2ED7BB351704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (49, 'Iglesia da Nosa Señora da Angustia', 0, '<p>S. XVIII. Neocl&aacute;sico. <br /><br />En la confluencia de las calles Campo da Angustia y r&uacute;a de Betanzos se alza este templo del siglo XVIII que, junto con el atrio, forma un conjunto proyectado siguiendo las pautas del neoclasicismo. <br /><br /></p>', ' ', ' ', ' ', 'Campo da Angustia, s/n.', 'http://www.santiagoturismo.com/monumentos/igrexa-da-nosa-senora-da-angustia', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000821E6ADB301221C0F6B6990AF1704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (50, 'Iglesia de San Fiz de Solovio', 15704, '<p>S. XVIII. Barroco.</p> <p>Es el templo compostelano de ra&iacute;ces m&aacute;s antiguas. De acuerdo con la tradici&oacute;n, all&iacute; moraba el ermita&ntilde;o Paio, descubridor de las reliquias del Ap&oacute;stol, a las que fue conducido por luces celestiales. La capilla altomedieval fue destruida por Almanzor y reconstruida por Diego Xelm&iacute;rez en el siglo XII. De hecho, el C&oacute;dice Calixtino la menciona ya entre las diez iglesias que ten&iacute;a Compostela en esa &eacute;poca. <br /><br />S&oacute;lo la portada es rom&aacute;nica. El t&iacute;mpano policromado que representa en relieve la Adoraci&oacute;n de los Magos fue realizado en 1316; la torre y el resto de la iglesia actual son obra de Sim&oacute;n Rodr&iacute;guez, quien en el siglo XVIII ampli&oacute; el recinto considerablemente y construy&oacute; un nuevo campanario con una factura que ser&iacute;a muy imitada en Galicia en los a&ntilde;os posteriores. <br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Praza de San Fiz de Solovio', 'http://www.santiagoturismo.com/monumentos/igrexa-de-san-fiz-de-solovio-4', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000006ADC59C35E1521C06F91287290704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (51, 'Iglesia de San Bieito do Campo', 15704, '<p>S. XVIII. Neocl&aacute;sico. <br /><br />Fue levantada por Prado Mari&ntilde;o sobre unas antiguas dependencias del siglo X que ya fueran reconstruidas en el siglo XII por el arzobispo Xelm&iacute;rez. La iglesia a pesar de la sobriedad y la pureza de l&iacute;neas y dentro de su peque&ntilde;o tama&ntilde;o, conserva un cierto aspecto monumental acentuado por su aislamiento en la plaza. Presenta una &uacute;nica torre central y una sola nave con capillas laterales. En su interior destacan las hermosas tallas barrocas de San Antonio, San Jos&eacute; y&nbsp;San Juan Bautista.</p>', ' ', 'España', 'Santiago de Compostela', 'Praza de Cervantes', 'http://www.santiagoturismo.com/monumentos/igrexa-de-san-bieito-do-campo-3', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000B3D17B5B971521C0118C834BC7704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (35, 'Casa das Pomas', 15705, '<p>Finales S. XVII. <br /><br />Probablemente fue Andrade quien estableci&oacute; el plano definitivo de esta casa. Destaca por la serie de frutas esculpidas en los extremos de la fachada y que cuelgan desde una concha situada en la parte superior.</p>', ' ', 'España', 'Santiago de Compostela', 'Rúa Nova 12', 'http://www.santiagoturismo.com/monumentos/casa-das-pomas', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000005C69211A401621C07DEA37978B704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (21, 'Seminario Menor', 0, '<p>S. XX. <br /><br />Se trata de una construcci&oacute;n de los a&ntilde;os cincuenta. Funciona como colegio y como Albergue de Peregrinos. <br /><br /></p>', ' ', ' ', ' ', 'Belvís, s/n.', 'http://www.santiagoturismo.com/monumentos/seminario-menor', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000002C67EF8CB61221C00DA7CCCD37704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (40, 'Pazo de San Lourenzo de Trasouto', 15705, '<p>S. XIII.</p> <p>Tras el frondoso robledal de San Lourenzo, se levanta este palacio mandado construir por el Obispo de Zamora, Mart&iacute;n Arias, en el siglo XIII. Estuvo ocupado por franciscanos y en el siglo XIX pas&oacute; a ser propiedad de los condes de Altamira que lo empleaban como residencia. Estos Condes fueron los que trajeron para el palacio desde el convento de San Francisco de Sevilla el hermoso retablo de m&aacute;rmol de Carrara del siglo XVI. A pesar de las numerosas reformas, conserva las naves rom&aacute;nicas del primer edificio. En la actualidad se explota como establecimiento de restauraci&oacute;n.</p>', '<p>S. XIII. Tras el frondoso robledal de San Lourenzo, se levanta este palacio mandado construir por el Obispo de Zamora, Mart&iacute;n Arias, en el siglo XIII. Estuvo ocupado por franciscanos y en el siglo XIX pas&oacute; a ser propiedad de los condes de Altamira que lo empleaban como residencia.</p> <p>&nbsp;</p>', 'España', 'Santiago de Compostela', 'Estrada de San Lourenzo ', 'http://www.santiagoturismo.com/monumentos/pazo-de-san-lourenzo-de-trasouto', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E6100000A8F68EBF591D21C05D4F956B61704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (46, 'Convento e Iglesia de las Madres Mercedarias', 15703, '<p>S. XVII. Barroco- neocl&aacute;sico. <br /><br />Extramuros, en la calle Fonte de Santo Antonio, frente a la puerta de Mazarelos, la &uacute;nica que se conserva de las antiguas murallas, se halla el Convento de las Madres Mercedarias. Fue fundado en 1671 por el Arzobispo Antonio Gir&oacute;n, cuyos restos reposan en su iglesia. En su fachada neocl&aacute;sica, flanqueada por pilastras corintias, destaca un relieve de la Anunciaci&oacute;n, obra del escultor barroco Mateo de Prado. <br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Tránsito da Mercé 1', 'http://www.santiagoturismo.com/monumentos/143', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E610000051EB05B8831521C07AC8730158704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (14, 'Convento del Carmen', 15704, '<p>S. XVIII. Barroco. <br /><br />En la confluencia de las calles Os Loureiros y Santa Clara se alza el austero convento de las Carmelitas Descalzas, orden de clausura tra&iacute;da a Compostela por la escritora m&iacute;stica gallega Mar&iacute;a Antonia de Jes&uacute;s. De estilo carmelitano, s&oacute;lido y sencillo, en la fachada -id&eacute;ntica a la de San José de Ávila- destacan la sillería de granito y la imagen policromada de la patrona de los marineros, atribuida a José Gambino.', ' ', 'España', 'Santiago de Compostela', 'Rúa de Santa Clara 8', 'http://www.santiagoturismo.com/monumentos/convento-do-carme-2', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E61000003B4130813A1521C019D024144F714540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (3, 'Mercado de Abastos', 15704, 'O actual Mercado de Abastos de Santiago foi construído en 1941, pero para falar da historia do Mercado temos que falar do seu predecesor, o Mercado da Cidade. É importante porque era a primeira vez que se daba un teito aos diferentes e dispersos mercados que existían naquela época en Compostela.', 'O actual Mercado de Abastos de Santiago foi construído en 1941, pero para falar da historia do Mercado temos que falar do seu predecesor, o Mercado da Cidade. É importante porque era a primeira vez que se daba un teito aos diferentes e dispersos mercados que existían naquela época en Compostela. En 1937 esborrallouse para a construción da actual Praza de Abastos. O Mercado estivo operando nos últimos tres séculos, converténdose nun centro líder na comercialización de produtos frescos en Santiago.', 'España', 'Santiago de Compostela', 'Travesía de Altamira', 'http://www.santiagoturismo.com/monumentos/mercado-de-abastos', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', 'mercado_abastos', 40, 0, '0101000020E61000001AAE69392B1521C0B976FDDD96704540', 80, 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis leo. Praesent laoreet laoreet libero eget condimentum. Cras pretium nibh neque, non porta metus rutrum vel. Fusce velit nunc, sagittis eget iaculis nec, dignissim a nunc. Mauris scelerisque metus ac viverra aliquet. Nullam nec turpis blandit, ornare erat dictum, vestibulum est. Maecenas sit amet fermentum lacus.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis 