INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (27, 'Convento e Iglesia de San Francisco', 15704, 'O Convento de San Francisco de Valdediós foi fundado por San Francisco de Asís durante a súa visita a Santiago de Compostela en 1214, no lugar de Val de Dios. A terra foi mercada aos monxes de San Martiño Pinario para o simbólico aluguer anual dunha cesta de troitas.', 'O Convento de San Francisco de Valdediós foi fundado por San Francisco de Asís durante a súa visita a Santiago de Compostela en 1214, no lugar de Val de Dios. A terra foi mercada aos monxes de San Martiño Pinario para o simbólico aluguer anual dunha cesta de troitas. A fundación, envolta en lendas, descríbese nunha inscrición na parede do actual convento. Alí dise que San Francisco encargou a construción dun carbón vexetal chamado Cotolay, que atopou milagrosamente un tesouro co que podería pagar esta obra.', 'España', 'Santiago de Compostela', 'Rúa do Campiño de San Francisco 3', 'http://www.santiagoturismo.com/monumentos/convento-e-igrexa-de-san-francisco', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', 'san_francisco', 20, 0, '0101000020E6100000A87CDF2A151721C0ED572A3D0D714540', 45, 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis leo. Praesent laoreet laoreet libero eget condimentum. Cras pretium nibh neque, non porta metus rutrum vel. Fusce velit nunc, sagittis eget iaculis nec, dignissim a nunc. Mauris scelerisque metus ac viverra aliquet. Nullam nec turpis blandit, ornare erat dictum, vestibulum est. Maecenas sit amet fermentum lacus.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis leo. Praesent laoreet laoreet libero eget condimentum. Cras pretium nibh neque, non porta metus rutrum vel. Fusce velit nunc, sagittis eget iaculis nec, dignissim a nunc. Mauris scelerisque metus ac viverra aliquet. Nullam nec turpis blandit, ornare erat dictum, vestibulum est. Maecenas sit amet fermentum lacus.', 'Sen horario. Misa ás 19:30 todos os días.', 0, 0);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (13, 'Casa da Conga', 15704, '<p>Principios S.XVIII. Barroco.<br /><br />Se trata de un edificio barroco constru&iacute;do para vivienda de los can&oacute;nigos de la catedral. El dise&ntilde;o inicial se debe a Domingo de Andrade, pero qui&eacute;n finaliz&oacute; la construcci&oacute;n en 1730 fue Casas y Novoa. Est&aacute; situada cerrando la parte sur de la Plaza de la Quintana.</p> <p>Se estructura como un bloque de cuatro casas con un vistoso p&oacute;rtico corrido que une las cuatro edificaciones. Es de estilo muy clasicista en contraste con la Casa da Parra situada en la parte superior de la plaza.</p> <p>En la actualidad&nbsp;es sede de Campus Stellae, instituci&oacute;n que desarrolla el centro de postgrado Instituto Europeo, el Espacio de Arte y centro coworking, as&iacute; como una oficina privada de atenci&oacute;n al peregrino. El resto est&aacute; ocupado por comercios, restaurantes, bares y cafeter&iacute;as.</p>', ' ', 'España', 'Santiago de Compostela', 'Praza da Quintana de Mortos', 'http://www.santiagoturismo.com/monumentos/casa-da-conga-1', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, 0, '0101000020E610000014FCC26D651621C0EAAE0D91AA704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (4, 'Hostal dos Reis Católicos', 15705, 'Os reis católicos ordenaron construír o edificio actual en 1501 para atender aos enfermos e peregrinos do divino Xacobe, como se pode ler na inscrición latina que atravesa o friso superior da portada. A súa construción, con todo, xa se decidiu en 1492 coincidindo co descubrimento de América.', 'O proxecto das obras débese ao arquitecto real Enrique Egas. Diante da fachada podemos ver unha forte cadea do século XVI sostida por piares coidadosamente esculpidos que delimita a propiedade do hospital e que ten a súa orixe en disputas patrimoniais entre o Concello e as autoridades do hospital. Ten unha fermosa fachada plateresca dos mestres franceses Martín de Blas e Guillén de Colás. Nas pilastras deste portal podemos ver de abaixo cara arriba, as figuras de Adán, Santa Catalina e San Xoán Bautista á esquerda e as de Eva, Santa Lucía e María Magdalena á dereita. No friso da porta, estruturado coma un arco de triunfo romano, as figuras dos doce apóstolos aparecen aliñadas. Nos colgantes do arco podemos ver os medallóns que recollen os bustos dos reis Isabel e Fernando. No friso, no corpo superior, ábrese a fiestra do Apartamento Real, reservada para acoller aos monarcas cando chegaron a Compostela e flanqueada polas imaxes de Cristo, a Virxe, Santiago, San Xoán Evanxelista, San Pedro e San Pablo . Dous grandes escudos, coas armas de Castela, tamén flanquean o portal. Percorrendo toda a parte frontal do edificio vemos os balcóns deseñados por Frei Tomás Alonso, apoiados en ménsulas moi traballadas que representan figuras fantasiosas. A cornixa está decorada cunha meticulosa cadea na que sobresaen gárgolas grotescas e obscenas.', 'España', 'Santiago de Compostela', 'Costa do Cristo ', 'http://www.santiagoturismo.com/monumentos/hostal-dos-reis-catolicos', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', 'hostal_reis_catolicos', 30, 0, '0101000020E6100000CDA7B7D47B1721C0825BD2ACC7704540', 45, 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis leo. Praesent laoreet laoreet libero eget condimentum. Cras pretium nibh neque, non porta metus rutrum vel. Fusce velit nunc, sagittis eget iaculis nec, dignissim a nunc. Mauris scelerisque metus ac viverra aliquet. Nullam nec turpis blandit, ornare erat dictum, vestibulum est. Maecenas sit amet fermentum lacus.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis leo. Praesent laoreet laoreet libero eget condimentum. Cras pretium nibh neque, non porta metus rutrum vel. Fusce velit nunc, sagittis eget iaculis nec, dignissim a nunc. Mauris scelerisque metus ac viverra aliquet. Nullam nec turpis blandit, ornare erat dictum, vestibulum est. Maecenas sit amet fermentum lacus.', 'Sen horario', 0, 0);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (5, 'Casa do Deán', 15705, '<p>Mediados s. XVIII. <br /><br />Fue construida entre 1747 y 1753 por Clemente Fern&aacute;ndez Sarela. Domina el conjunto la decoraci&oacute;n de la fachada alrededor de la puerta principal, dise&ntilde;ada a base de placas, volutas y cilindros, atributos jacobeos y pin&aacute;culos, todos de considerable robustez. Destacan ya en el interior un amplio vest&iacute;bulo y una elegante escalera. La profusa decoraci&oacute;n funde la puerta y el balc&oacute;n situado encima que parece proyectarse sobre la calle. Era propiedad de Do&ntilde;a Xoana de Ulloa, perteneciente a uno de los m&aacute;s nobles linajes de Galicia, y en ella se hospedaban los obispos forasteros que visitaban Compostela. M&aacute;s tarde fue destinada al uso de los deanes de la Catedral apost&oacute;lica.<br /><br /></p>', ' ', 'España', 'Santiago de Compostela', 'Rúa do Vilar 1', 'http://www.santiagoturismo.com/monumentos/casa-do-dean', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', NULL, 0, NULL, '0101000020E61000000DE476BBA01621C01598045E9C704540', 0, 0, '', '', NULL, NULL, NULL);
INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (43, 'Pazo de Xelmírez', 15704, 'Inclinado polo lado norte da Catedral e cara á Praza do Obradoiro, levántase este Palacio Episcopal, mandado construír polo arcebispo Diego Xelmírez para substituír a antiga residencia episcopal derrubada durante as revoltas.', 'Inclinado polo lado norte da Catedral e cara á Praza do Obradoiro, levántase este Palacio Episcopal, mandado construír polo arcebispo Diego Xelmírez para substituír a antiga residencia episcopal derrubada durante as revoltas. No século XVIII engadiuse un novo andar encima das dúas iniciais, que está desfasado coa primitiva construción románica e que obrigou a reforzar os muros cunha nova fachada como contraforte.', 'España', 'Santiago de Compostela', 'Praza do Obradoiro', 'http://www.santiagoturismo.com/monumentos/pazo-de-xelmirez-2', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', 'pazo_xelmirez', 60, 0, '0101000020E6100000E2412FB33A1721C05E196DB8BC704540', 90, 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis leo. Praesent laoreet laoreet libero eget condimentum. Cras pretium nibh neque, non porta metus rutrum vel. Fusce velit nunc, sagittis eget iaculis nec, dignissim a nunc. Mauris scelerisque metus ac viverra aliquet. Nullam nec turpis blandit, ornare erat dictum, vestibulum est. Maecenas sit amet fermentum lacus.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis leo. Praesent laoreet laoreet libero eget condimentum. Cras pretium nibh neque, non porta metus rutrum vel. Fusce velit nunc, sagittis eget iaculis nec, dignissi