INSERT INTO fresh_tour.monumentos (id, titulo, cp, contexto, resumo, pais, municipio, direccion, url, data_adicion, data_modificacion, imaxe, tempo_visita_rapida, valoracion, geom, tempo_visita_lenta, tempo_visita_usuario, comentario_visita_rapida, comentario_visita_lenta, horario, prezo, prezo_reducido) VALUES (2, 'Catedral', 15705, 'A catedral de Santiago de Compostela é a obra de arte románica máis destacada de España. É tamén o obxectivo final de todos os Camiños de Santiago, que durante séculos levaron aos peregrinos da cristiandade á tumba dun apóstolo.', 'A catedral de Santiago de Compostela é a obra de arte románica máis destacada de España. É, ademais, o obxectivo final de todos os camiños de Santiago, que durante séculos levaron aos peregrinos da cristiandade á tumba dun apóstolo. Por se fora pouco, foi a pedra inaugural para a construción dunha cidade monumental, Santiago de Compostela, que naceu nun bosque sagrado na fin do mundo con vocación de cidade santa e patrimonio da humanidade.', 'España', 'Santiago de Compostella', 'Praza do Obradoiro', 'http://www.santiagoturismo.com/monumentos/../catedral-de-santiago', '2021-03-30 17:42:56.351378', '2021-03-30 17:42:56.351378', 'catedral', 90, NULL, '0101000020E61000001BBAD91F281721C0F6251B0FB6704540', 140, 0, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis leo. Praesent laoreet laoreet libero eget condimentum. Cras pretium nibh neque, non porta metus rutrum vel. Fusce velit nunc, sagittis eget iaculis nec, dignissim a nunc. Mauris scelerisque metus ac viverra aliquet. Nullam nec turpis blandit, ornare erat dictum, vestibulum est. Maecenas sit amet fermentum lacus.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam dapibus lectus vulputate mi vehicula tempor. Aliquam eu venenatis leo. Praesent laoreet laoreet libero eget condimentum. Cras pretium nibh neque, non porta metus rutrum vel. Fusce velit nunc, sagittis 